INSERT INTO `mision` (`id_mision`, `id_profile`, `tipo`, `titulo`, `contenido`, `archivo`) VALUES
	(1, 1, 'mission', '', '<p>&nbsp;<strong style="line-height: 14px; text-align: justify; font-family: Arial, Helvetica, sans; font-size: 11px; ">Lorem Ipsum</strong><span style="line-height: 14px; text-align: justify; font-family: Arial, Helvetica, sans; font-size: 11px; ">&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</span></p>\r\n<div style="margin: 0px; font-size: 11px; font-family: Arial, Helvetica, sans; text-align: center; ">\r\n<div class="rc" style="margin: 0px; clear: right; float: right; width: 348px; ">\r\n<h2 class="why" style="margin: 0px; padding: 0px; font-weight: normal; font-size: 12px; height: 26px; text-align: left; background-image: url(http://www.lipsum.com/images/en/heading.gif); background-position: 0px -52px; background-repeat: no-repeat no-repeat; ">&nbsp;</h2>\r\n<p style="text-align: justify; line-height: 14px; margin: 0px 0px 14px; padding: 0px; ">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>\r\n</div>\r\n</div>\r\n<p><span style="font-family: Arial, Helvetica, sans; font-size: 11px; text-align: center; ">&nbsp;</span></p>\r\n<div style="margin: 0px; font-size: 11px; font-family: Arial, Helvetica, sans; text-align: center; clear: both; ">\r\n<div class="lc" style="margin: 0px; clear: left; float: left; width: 348px; ">\r\n<h2 class="where" style="margin: 0px; padding: 0px; font-weight: normal; font-size: 12px; height: 26px; text-align: left; background-image: url(http://www.lipsum.com/images/en/heading.gif); background-position: 0px -26px; background-repeat: no-repeat no-repeat; ">&nbsp;</h2>\r\n<p style="text-align: justify; line-height: 14px; margin: 0px 0px 14px; padding: 0px; ">Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of &quot;de Finibus Bonorum et Malorum&quot; (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, &quot;Lorem ipsum dolor sit amet..&quot;, comes from a line in section 1.10.32.</p>\r\n<p style="text-align: justify; line-height: 14px; margin: 0px 0px 14px; padding: 0px; ">The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from &quot;de Finibus Bonorum et Malorum&quot; by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.</p>\r\n</div>\r\n</div>', 'mission_1_banesconlinelunes30d.pdf'),
	(2, 8, 'mission', '', '<p>&nbsp;<span style="font-family: Arial, \'Liberation Sans\', \'DejaVu Sans\', sans-serif; font-size: 14px; line-height: 18px; text-align: left; ">&nbsp;have an embedded form with a choice widget. I\'m trying to pass a default value from the main form to the widget. I\'m trying to pass the value to the form as an option, then once I have it in the embedded form do I just do something like:</span></p>', ''),
