INSERT INTO `sf_section_i18n` (`name_section`, `descrip_section`, `meta_title`, `meta_keyword`, `meta_description`, `id`, `language`) VALUES
	('home', '<p>teste</p>', '', 'Brain Fitness and Brain Training', 'Brain Fitness and Brain Training', 1, 'pt'),
	('Banco de Cartografia', '', '', '', '', 100, 'pt'),
	('Livraria', '', '', '', '', 66, 'pt'),
	('Fotos e Vídeos', '<p>Caso tenha alguma foto ou v&iacute;deo da FITO, nos envie a foto ou o link do youtube! N&oacute;s analisaremos e, se aprovado, colocaremos no site.</p>\r\n<p>Envie para: <strong>comunicacao@fito.edu.br</strong></p>', '', '', '', 83, 'pt'),
	('Fale com a ABGE', '', '', '', '', 98, 'pt'),
	('Galeria de Fotos', '', '', '', '', 67, 'pt'),
	('Vídeos', '', '', '', '', 68, 'pt'),
	('Detalle Noticias', '', NULL, NULL, NULL, 23, 'pt'),
	('Notícias', '', '', '', '', 24, 'pt'),
	('Eventos', '', '', '', '', 99, 'pt'),
	('Cadastre sua Empresa', '', '', '', '', 74, 'pt'),
	('Vagas', '', '', '', '', 75, 'pt'),
	('Cursos', '<p>&nbsp;</p>\r\n<p><a href="http://www.abge.com.br/cartografia"><strong><span style="font-size: larger;"><span style="font-family: Verdana;"><small>Curso -</small></span></span></strong><span style="font-size: larger;"><span style="font-family: Verdana;"><small> Cartografia Geot&eacute;cnicas </small></span></span></a></p>\r\n<p><span style="font-size: larger;"><span style="font-family: Verdana;"><small><a href="http://www.abge.com.br/classificacaodesondagens"><strong>Curso - </strong>Classifica&ccedil;&atilde;o de Sondagens - SP</a></small></span></span></p>\r\n<p><span style="font-size: larger;"><span style="font-family: Verdana;"><small><a href="http://www.abge.com.br/classificacaodesondagensmg"> <strong>Curso - </strong>Classifica&ccedil;&atilde;o de Sondagens - MG </a></small></span></span></p>\r\n<p><span style="font-size: larger;"><span style="font-family: Verdana;"><small><a href="http://www.abge.com.br/classificacaodesondagensrj"><strong>Curso -</strong> Classifica&ccedil;&atilde;o de Sondagens - RJ </a></small></span></span></p>\r\n<p><span style="font-size: larger;"><span style="font-family: Verdana;"><small><a href="http://www.abge.com.br/erosao"><strong>Curso -</strong> Eros&atilde;o e Controle de Sedimento </a></small></span></span></p>\r\n<p><span style="font-size: larger;"><span style="font-family: Verdana;"><small><a href="http://www.abge.com.br/geofisica"><strong>Curso - </strong>Geof&iacute;sica Aplicada &agrave; Geologia de Engenharia, Geotecnia e Meio Ambiente</a></small></span></span></p>\r\n<p><span style="font-size: larger;"><span style="font-family: Verdana;"><small><a href="http://www.abge.com.br/investigacoes"> <strong>Curso -</strong> Investiga&ccedil;&otilde;es Geoambientais de &Aacute;reas Contaminadas - Planejamento, T&eacute;cnicas e Procedimentos </a></small></span></span></p>\r\n<p><span style="font-size: larger;"><span style="font-family: Verdana;"><small><a href="http://www.abge.com.br/praticasdeensaios"><strong>Curso -</strong> Praticas de Ensaios de Condutividades Hidr&aacute;ulica de Maci&ccedil;os </a></small></span></span></p>\r\n<p><span style="font-size: larger;"><span style="font-family: Verdana;"><small><a href="http://www.abge.com.br/riscosemobras"><strong>Curso -</strong> Riscos em Obras de Engenharia </a></small></span></span></p>\r\n<p><span style="font-size: larger;"><span style="font-family: Verdana;"><small><a href="http://www.abge.com.br/riscos"><strong>Curso -</strong> Riscos Geol&oacute;gicos Naturais </a></small></span></span></p>\r\n<p><span style="font-size: larger;"><span style="font-family: Verdana;"><small><a href="http://www.abge.com.br/tuneis"><strong>Curso -</strong> T&uacute;neis: Investiga&ccedil;&otilde;es, Modelagem, Projetos e acompanhamento T&eacute;cnico da Obra</a></small></span></span></p>', '', '', '', 76, 'pt'),
	('Resultado da Busca', '', '', '', '', 77, 'pt'),
	('ABGE', '<p><strong>Geologia de Engenharia Ambiental</strong><br />\r\n<br />\r\nA Geologia de Engenharia &eacute; um dos ramos aplicados da Geoci&ecirc;ncias, sendo definida como &ldquo;ci&ecirc;ncia dedicada &agrave; investiga&ccedil;&atilde;o, estudo e solu&ccedil;&atilde;o de problemas de engenharia e meio ambiente, decorrentes da intera&ccedil;&atilde;o entre a Geologia e os trabalhos e atividades do homem, bem como &agrave; previs&atilde;o e desenvolvimento de medidas preventivas ou reparadoras de acidentes geol&oacute;gicos&rdquo;, segundo conceito expresso nos estatutos da Associa&ccedil;&atilde;o Internacional de Geologia de Engenharia e Ambiental (IAEG, 1992) e adotado pela ABGE.&nbsp;</p>\r\n<p>A Associa&ccedil;&atilde;o busca estimular o avan&ccedil;o do conhecimento e aplica&ccedil;&atilde;o da Geologia na solu&ccedil;&atilde;o dos problemas de Engenharia e do Meio Ambiente. Bem como na preven&ccedil;&atilde;o e corre&ccedil;&atilde;o de acidentes geol&oacute;gicos.</p>\r\n<p><strong>&Aacute;reas de Atua&ccedil;&atilde;o</strong></p>\r\n<p>De acordo com os estatutos da IAEG e da ABGE a Geologia de Engenharia abrange:</p>\r\n<p>* Defini&ccedil;&atilde;o das condi&ccedil;&otilde;es da geomorfologia, estrutura, estratigrafia, litologia e &aacute;gua subterr&acirc;nea das forma&ccedil;&otilde;es geol&oacute;gicas;</p>\r\n<p>* Caracteriza&ccedil;&atilde;o das propriedades mineral&oacute;gicas, f&iacute;sicas, geomec&acirc;nicas, qu&iacute;micas e hidr&aacute;ulicas de todos os materiais terrestres envolvidos em constru&ccedil;&atilde;o, recupera&ccedil;&atilde;o de recursos e altera&ccedil;&otilde;es ambientais;</p>\r\n<p>* Avalia&ccedil;&atilde;o do comportamento mec&acirc;nico e hidrol&oacute;gico dos solos e maci&ccedil;os rochosos;</p>\r\n<p>* Previs&atilde;o de altera&ccedil;&otilde;es, ao longo do tempo, das propriedades citadas anteriormente;</p>\r\n<p>* Determina&ccedil;&atilde;o dos par&acirc;metros a serem considerados na an&aacute;lise de estabilidade de obras de engenharia e de maci&ccedil;os naturais;</p>\r\n<p>* Melhoria e manuten&ccedil;&atilde;o das condi&ccedil;&otilde;es ambientais e das propriedades dos terrenos.</p>\r\n<p><strong>Principais &aacute;reas de atua&ccedil;&atilde;o da ABGE</strong></p>\r\n<p><br />\r\n* Recursos H&iacute;dricos</p>\r\n<p>* Obras Subterr&acirc;neas</p>\r\n<p>* Processos e Riscos Geol&oacute;gicos</p>\r\n<p>* Barragens e Reservat&oacute;rios</p>\r\n<p>* Minera&ccedil;&otilde;es</p>\r\n<p>* Cartografia Geot&eacute;cnica e Geoambiental</p>\r\n<p>* Obras lineares: dutos, rodovias, ferrovias, hidrovias, linhas de transmiss&atilde;o</p>\r\n<p>* Res&iacute;duos e &Aacute;reas Contaminadas</p>\r\n<p>* Recupera&ccedil;&atilde;o de &Aacute;reas Degradadas</p>\r\n<p>* Planejamento e Gest&atilde;o Ambiental</p>\r\n<p>* Obras mar&iacute;timas</p>\r\n<p>* Geof&iacute;sica</p>\r\n<p>* Legisla&ccedil;&atilde;o</p>\r\n<p>* Infraestrutura</p>\r\n<p>* Geologia Urbana</p>\r\n<p>&nbsp;</p>', '', '', '', 87, 'pt'),
	('IAEG', '', '', '', '', 101, 'pt'),
