	('Revistas', '<p style="text-align: center;">&nbsp;<img src="http://abge1.hospedagemdesites.ws/uploads/imagens/CAPA_REVISTA.jpg" alt="" /></p>', '', '', '', 107, 'pt'),
	('Institucional', '<div style="text-align: justify;"><strong><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Geologia de Engenharia e Ambiental</big></span></span></span></strong><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><br />\r\n&nbsp; </big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>A Geologia de Engenharia e Ambiental &eacute; a ci&ecirc;ncia dedicada &agrave; investiga&ccedil;&atilde;o, estudo e solu&ccedil;&atilde;o de problemas de Engenharia e do Meio Ambiente decorrentes da intera&ccedil;&atilde;o entre a Geologia e outras ci&ecirc;ncias correlatas e os trabalhos e atividades humanas.<br />\r\n&nbsp;&nbsp; <br />\r\n&Aacute;reas de Atua&ccedil;&atilde;o<br />\r\n&nbsp;<br />\r\nDe acordo com o estatuto da ABGE a Geologia de Engenharia abrange:<br />\r\n&nbsp;<br />\r\n- a investiga&ccedil;&atilde;o e caracteriza&ccedil;&atilde;o da morfologia,estrutura, estatigrafia, litologia e propriedades das forma&ccedil;&otilde;es geol&oacute;gicas;<br />\r\n- Caracteriza&ccedil;&atilde;o das propriedades mineral&oacute;gicas, f&iacute;sicas, geomec&acirc;nicas, qu&iacute;micas e hidr&aacute;ulicas de todos os materiais terrestres envolvidos em constru&ccedil;&atilde;o, recupera&ccedil;&atilde;o de recursos e altera&ccedil;&otilde;es do meio ambiente;<br />\r\n- a avalia&ccedil;&atilde;o do comportamento geomec&acirc;nico e hidrogeol&oacute;gico dos solos e maci&ccedil;os rochosos e terrosos;<br />\r\n- a preven&ccedil;&atilde;o de altera&ccedil;&otilde;es ao longo do tempo do tempo das propriedades acima;<br />\r\n- a determina&ccedil;&atilde;o dos par&acirc;metros a serem considerados nas an&aacute;lises de estabilidade e na opera&ccedil;&atilde;o confi&aacute;vel&nbsp; das obras de Engenharia;<br />\r\n- a prote&ccedil;&atilde;o, recupera&ccedil;&atilde;o, melhoria e manuten&ccedil;&atilde;o das condi&ccedil;&otilde;es ambientais.<br />\r\n<br />\r\n<strong>A ABGE</strong></big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><br />\r\nH&aacute; mais de 40 anos a ABGE trabalha para agregar profissionais, estudantes, empresas e institui&ccedil;&otilde;es de pesquisas e ensino que atuam na Geologia de Engenharia e Ambiental, estimulando o debate e a reflex&atilde;o em temas desta &aacute;rea t&eacute;cnico-cient&iacute;fica, que envolve a previs&atilde;o do comportamento geol&oacute;gico face &agrave;s solicita&ccedil;&otilde;es das obras de engenharia e infraestrutura. Com mais de 800 s&oacute;cios, a entidade conta com uma sede nacional, em S&atilde;o Paulo, dois n&uacute;cleos regionais (Rio de Janeiro e Minas Gerais) e quinze representa&ccedil;&otilde;es regionais por todo o pa&iacute;s, constituindo uma das associa&ccedil;&otilde;es mais ativas da International Association for Engineering Geology and the Environment &ndash; IAEG.</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><br />\r\nA ABGE busca promover a dissemina&ccedil;&atilde;o do conhecimento por meio da realiza&ccedil;&atilde;o de: simp&oacute;sios, congressos, workshops, reuni&otilde;es t&eacute;cnicas, mesas redondas, palestras, jornadas estudantis e confer&ecirc;ncias. Edi&ccedil;&atilde;o de livros, manuais, anais de congresso e revistas, al&eacute;m da organiza&ccedil;&atilde;o de cursos.<br />\r\n</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>A ABGE pode formar Comiss&otilde;es T&eacute;cnicas Comiss&otilde;es T&eacute;cnicas oque desempenham papel importante constituindo grupos de trabalho, por parte dos associados interessados, que atuam em temas espec&iacute;ficos da Geologia de Engenharia e Ambiental.<br />\r\n<br />\r\nPrincipais &aacute;reas de atua&ccedil;&atilde;o da ABGE:<br />\r\n<br />\r\nI - PLANEJAMENTO URBANO E REGIONAL<br />\r\nCartografia geot&eacute;cnica e geoambiental<br />\r\nRiscos geol&oacute;gicos e Defesa Civil<br />\r\nGeologia urbana<br />\r\nEros&atilde;o, assoreamento e enchentes<br />\r\nUso e ocupa&ccedil;&atilde;o do solo<br />\r\nPlano diretor municipal<br />\r\nPlano regional de desenvolvimento sustent&aacute;vel<br />\r\n<br />\r\nII - GEST&Atilde;O AMBIENTAL<br />\r\nLicenciamento ambiental<br />\r\nPlanejamento e gest&atilde;o ambiental<br />\r\nRes&iacute;duos s&oacute;lidos<br />\r\n&Aacute;reas contaminadas<br />\r\n&Aacute;reas degradadas<br />\r\nRecursos h&iacute;dricos superficiais e subterr&acirc;neos<br />\r\nPlano de bacia hidrogr&aacute;fica<br />\r\n<br />\r\nIII - INFRAESTRUTURA<br />\r\nPlanejamento, projeto e acompanhamento de constru&ccedil;&atilde;o de obras <br />\r\nBarragens e reservat&oacute;rios<br />\r\nHidrel&eacute;tricas e termoel&eacute;tricas<br />\r\nMinera&ccedil;&atilde;o subterr&acirc;nea e a c&eacute;u aberto<br />\r\nObras subterr&acirc;neas: t&uacute;neis, casas de for&ccedil;a, c&acirc;maras de estocagem<br />\r\nObras lineares: metr&ocirc;s, dutos, rodovias, ferrovias, canais, linhas de transmiss&atilde;o<br />\r\nPortos e obras mar&iacute;timas<br />\r\nRiscos geol&oacute;gicos em obras <br />\r\nGeoengenharia de petr&oacute;leo<br />\r\n<br />\r\nIV - GERAL <br />\r\nDissemina&ccedil;&atilde;o do conhecimento: congressos, semin&aacute;rios, oficinas, publica&ccedil;&otilde;es e cursos<br />\r\nPol&iacute;ticas p&uacute;blicas, legisla&ccedil;&atilde;o e organiza&ccedil;&atilde;o institucional<br />\r\nEnsino e jovem profissional<br />\r\nArbitragem e per&iacute;cia<br />\r\nManuais, Diretrizes, Padroniza&ccedil;&atilde;o de procedimentos&nbsp; <br />\r\nInform&aacute;tica aplicada &agrave; geologia de engenharia e ambiental<br />\r\n<br />\r\nV &ndash; &Aacute;REAS T&Eacute;CNICAS ESPEC&Iacute;FICAS<br />\r\nSondagens e investiga&ccedil;&otilde;es geol&oacute;gicas e geot&eacute;cnicas<br />\r\nTaludes e Encostas Naturais e de Escava&ccedil;&atilde;o<br />\r\nCaracteriza&ccedil;&atilde;o tecnol&oacute;gica e mec&acirc;nica de solos, rochas e maci&ccedil;os rochosos<br />\r\n&Aacute;gua subterr&acirc;nea e hidrogeotecnia<br />\r\nModelagem geomec&acirc;nica de maci&ccedil;os rochosos <br />\r\nGeof&iacute;sica aplicada<br />\r\nMateriais naturais de constru&ccedil;&atilde;o <br />\r\nTens&otilde;es naturais e induzidas em maci&ccedil;os rochosos<br />\r\nFunda&ccedil;&otilde;es e Escava&ccedil;&otilde;es<br />\r\nSismologia natural e induzida<br />\r\n<br />\r\n&nbsp;A entidade conta com tr&ecirc;s categorias de filia&ccedil;&atilde;o: ABGE Jovem, destinada aos estudantes, Titular, voltada para todos profissionais e Patrocinador, dedicada as empresas e institui&ccedil;&otilde;es interessadas em apoiar as atividades da ABGE e divulgar sua marca. Os associados da ABGE recebem todas publica&ccedil;&otilde;es editadas pela associa&ccedil;&atilde;o (livros, tradu&ccedil;&otilde;es, artigos t&eacute;cnicos, anais de simp&oacute;sios e congressos), a Revista Brasileira de Geologia de Engenharia e Ambiental, al&eacute;m da Caderneta de Campo ABGE, </big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>ABGE em Revista,</big></span></span></span> Infomails, este contendo assuntos e eventos do momento.<br />\r\n</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><br />\r\n</big></span></span></span></div>\r\n<p>&nbsp;</p>', '', '', '', 108, 'pt'),
