	('Secretaria', '<div><strong><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Renivaldo Campos</big></span></span></span></strong><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><br />\r\nGerente Executivo<br />\r\nE-mail: abge@ipt.br<br />\r\n&nbsp;<br />\r\n<strong>Nill Cavalcante</strong><br />\r\nCoordenador de Comunica&ccedil;&atilde;o e Marketing<br />\r\nE-mail: marketing@abge.com.br<br />\r\n&nbsp;<br />\r\n<strong>Luciana Marques</strong><br />\r\nEst&aacute;giaria<br />\r\nE-mail: abge@abge.com.br</big></span></span></span></div>', '', '', '', 114, 'pt'),
	('Plano de Atividades', '<div style="text-align: left;"><strong><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>BALAN&Ccedil;O DE ATIVIDADES 2012 E PRIORIDADES PARA 2013<br />\r\nATIVIDADES REALIZADAS EM 2012</big></span></span></span></strong><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><br />\r\n<br />\r\n1. 14&ordm; CONGRESSO BRASILEIRO DE GEOLOGIA DE ENGENHARIA E AMBIENTAL &ndash; 14CBGE<br />\r\n1.1 Crit&eacute;rios gerais do evento: OK (os mesmos do Congresso de SP)<br />\r\n1.2 Contrato com ACQUA: OK<br />\r\n1.3 Circular 01 pela ABGE: OK<br />\r\n1.4 Site da ACQUA com temas e chamada de trabalhos: OK <br />\r\n1.5 Listagem de convidados: conferencistas e integrantes de Mesas: indica&ccedil;&atilde;o &agrave; Acqua at&eacute; 15/12/12<br />\r\n1.6 Montagem/organiza&ccedil;&atilde;o da Comiss&atilde;o Organizadora: 70% conclu&iacute;da<br />\r\n(Em andamento: defini&ccedil;&atilde;o de coordenadores de simp&oacute;sios, de cursos e de visitas t&eacute;cnicas e secretaria de apoio geral no Rio/SP)<br />\r\n1.7 Financiamentos/cotas de patroc&iacute;nio: contatos incipientes<br />\r\n1.8 Local/lay out da exposi&ccedil;&atilde;o: em processo de defini&ccedil;&atilde;o&nbsp; <br />\r\n1.9 Envio de circular para a newsletter da IAEG<br />\r\n<br />\r\n2.&nbsp; REVISTA BRASILEIRA DE GEOLOGIA DE ENGENHARIA E AMBIENTAL - RBGEA<br />\r\n- Edi&ccedil;&atilde;o digital da Revista no 2 &ndash; OK<br />\r\n- Edi&ccedil;&atilde;o digital da Revista no 3 &ndash;&nbsp; trabalhos em an&aacute;lise pela Comiss&atilde;o Editorial <br />\r\n- Edi&ccedil;&atilde;o impressa&nbsp; 2&ordm; e 3&ordm; n&uacute;meros&nbsp; &ndash; previsto mar&ccedil;o/13<br />\r\n<br />\r\n3. PUBLICA&Ccedil;&Otilde;ES<br />\r\n3.1 ABGE em Revista<br />\r\n- Defini&ccedil;&atilde;o dos editores: OK<br />\r\n- Editada a no 92 <br />\r\n- No 93 - Mat&eacute;ria em revis&atilde;o (94 prevista para mar&ccedil;o/13)<br />\r\n3.2 Livros/publica&ccedil;&otilde;es <br />\r\n- Guia de Boas Pr&aacute;ticas de Recupera&ccedil;&atilde;o Ambiental em Pedreiras e Minas de Calc&aacute;rio: OK<br />\r\n- Altera&ccedil;&atilde;o de Rochas: OK<br />\r\n- Guia Brasileiro de Empresas de Geotecnia: OK<br />\r\n- Gloss&aacute;rio de Termos T&eacute;cnicos: em editora&ccedil;&atilde;o<br />\r\n- Caderneta de Campo: em editora&ccedil;&atilde;o (Revis&atilde;o de tabelas)<br />\r\n- Manual de Sondagens: 90% <br />\r\n- Manual de Campo de Geologia de Engenharia: 60% dos cap&iacute;tulos traduzidos<br />\r\n- Manual de Permeabilidade em Solos: 60%<br />\r\n- Diretrizes para Descri&ccedil;&atilde;o de Sondagens &ndash; 1&ordf; Tentativa &ndash; 70% <br />\r\n<br />\r\n4. CURSOS<br />\r\n4.1 Em SP, em parceria com SIGESP/CREA: <br />\r\n- Investiga&ccedil;&otilde;es diretas e indiretas: OK<br />\r\n- Riscos Geol&oacute;gicos associados a &Aacute;reas Urbanas: OK<br />\r\n- Legisla&ccedil;&atilde;o Ambiental - Ok<br />\r\n- Per&iacute;cia Judicial em Meio Ambiente: OK <br />\r\n- Legisla&ccedil;&atilde;o Mineral &ndash; Pr&aacute;tica: Ok<br />\r\n- Pr&aacute;ticas de Uso de Receptores GPS de Navega&ccedil;&atilde;o para Planejamento e Geologia &ndash; OK<br />\r\n4.2 Cursos especiais<br />\r\n- Funda&ccedil;&otilde;es de barragens de concreto: OK (SP e MG)<br />\r\n- Geof&iacute;sica de Aplicada &agrave; Geologia de Engenharia, Geotecnia e Meio Ambiente: OK (SP)<br />\r\n- T&uacute;neis: em in&iacute;cio de organiza&ccedil;&atilde;o (SP)<br />\r\n- Bioengenharia de solos em &aacute;reas degradadas: previsto para maio 2013<br />\r\n<br />\r\n<br />\r\n<br />\r\n5. EVENTOS: SEMIN&Aacute;RIOS/MESAS REDONDAS/PALESTRAS<br />\r\n- Atribui&ccedil;&otilde;es Profissionais e Resolu&ccedil;&atilde;o CONFEA 1010 (com SIGESP/CAGE-CREA/IG-USP - Ok<br />\r\n- Riscos Geol&oacute;gicos em SC - OK <br />\r\n- Lei 12.608 na ALESP &ndash; OK (Pend&ecirc;ncias: publica&ccedil;&atilde;o/projeto de lei estadual)<br />\r\n- Rad&ocirc;nio: Aspectos geot&eacute;cnicos, geol&oacute;gicos e os efeitos sobre a sa&uacute;de: OK (com ABMS)<br />\r\n- SPT com amostragem integral &ndash; OK (com ABMS)<br />\r\n- Chuvas no RJ &ndash;&nbsp; OK (com ABMS/Clube de Engenharia)<br />\r\n5.1 Participa&ccedil;&atilde;o em eventos<br />\r\nCoordena&ccedil;&atilde;o da Grande &Aacute;rea 11&nbsp; &ndash; Geologia de Engenharia, Ambiental e Planejamento durante o 46&ordm; CBG com a organiza&ccedil;&atilde;o dos seguintes simp&oacute;sios:<br />\r\n- Riscos Geol&oacute;gicos e Desastres Naturais<br />\r\n- Avalia&ccedil;&atilde;o de Impactos Ambientais e Recupera&ccedil;&atilde;o de &Aacute;reas Degradadas<br />\r\n- Planejamento Urbano, Rural e Gest&atilde;o Territorial<br />\r\n- Geologia em projetos e obras de Engenharia<br />\r\n&nbsp;&nbsp;&nbsp; <br />\r\nAl&eacute;m disso, realizou o Curso Pr&eacute;-Congresso &ldquo;Riscos Geol&oacute;gicos&rdquo;<br />\r\n<br />\r\n6) ATIVIDADES DIVERSAS <br />\r\n6.1 Divulga&ccedil;&atilde;o da ABGE no Congresso SBG(Santos), Geomorfologia (Rio) e de eventos estudantis em Ouro Preto (MG), Santa Maria (RS) e Rio de Janeiro (RJ)<br />\r\n6.1 Novo Site: 90% (em processo de alimenta&ccedil;&atilde;o de dados)<br />\r\n6.2 Pr&ecirc;mio ABGE- ABMS-CBDB &ldquo;M&aacute;rios &rdquo;: 50% (2&ordf; minuta de regulamento em an&aacute;lise)<br />\r\n6.2 V&iacute;deo institucional: 30%<br />\r\n6.3 Texto Wikip&eacute;dia: 30%<br />\r\n6.4 Portal Geotecnia com ABMS: 10%<br />\r\n6.5 Boletim eletr&ocirc;nico piloto:&nbsp; n&atilde;o iniciado<br />\r\n6.6 Eventos com Representa&ccedil;&otilde;es Regionais: previstos para Bras&iacute;lia, Palmas e Cuiab&aacute; n&atilde;o realizados<br />\r\n<br />\r\n7) DIRETORIA ESPECIAL DE ENSINO E DO JOVEM PROFISSIONAL<br />\r\n7.1. Levantamento de conte&uacute;do de disciplinas de GEA em cursos no Brasil: 100%<br />\r\n7.2 Palestras sobre ensino para Gera&ccedil;&atilde;o Z: n&atilde;o iniciado<br />\r\n7.3 Pr&ecirc;mio ABGE Jr: n&atilde;o iniciado<br />\r\n7.4 Produ&ccedil;&atilde;o de material did&aacute;tico: n&atilde;o iniciado<br />\r\n<br />\r\n8) IAEG E COMGEA<br />\r\n8.1 Indica&ccedil;&atilde;o de representantes da ABGE para Congresso IAEG 2014: OK<br />\r\n8.2 Vinda do Secret&aacute;rio da IAEG ao Brasil em 2013/Evento China-Brasil: tratativas em andamento<br />\r\n8.3 Informa&ccedil;&otilde;es da ABGE para Site e Boletim IAEG: OK<br />\r\n8.4 COMGEA: Funda&ccedil;&atilde;o, regulamento e elei&ccedil;&atilde;o de coordenador: OK <br />\r\n8.5 COMGEA: Plano de Trabalho proposto pelo Coordenador, em an&aacute;lise.<br />\r\n<br />\r\nPRIORIDADES PARA 2013<br />\r\n1. 14 CBGE<br />\r\n2. REVISTA BRASILEIRA DE GEA<br />\r\n3. DAR CONTINUIDADE AOS TRABALHOS: SITE, PUBLICA&Ccedil;&Otilde;ES, EVENTOS...&nbsp; <br />\r\n4. INCENTIVO A NOVOS CURSOS E A AUTORES PUBLICAREM PELA ABGE</big></span></span></span></div>\r\n<div style="text-align: left;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>5. ENSINO<br />\r\n6. GEST&Atilde;O<br />\r\n6.1 Refor&ccedil;ar a participa&ccedil;&atilde;o volunt&aacute;ria e as parcerias com outras entidades<br />\r\n6.2 Dar apoio aos N&uacute;cleos e Rep. Regionais<br />\r\n6.3 Participar de marcos regulat&oacute;rio de Pol&iacute;ticas P&uacute;blicas</big></span></span></span></div>', '', '', '', 115, 'pt'),
	('Diretoria ', '<div>\r\n<p><strong><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Diretoria ABGE Gest&atilde;o 2014/2015</big></span></span></span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><img width="640" height="237" src="/uploads/imgfck/image/DSC06763_red.jpg" alt="" /><br />\r\n&nbsp; </big></span></span></span></p>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big> Presidente:Adalberto Aur&eacute;lio Azevedo<br />\r\nVice Presidente: Delfino Luiz Gouveia Gambetti<br />\r\nDiretor Secret&aacute;rio: Alessandra Cristina Corsi</big></span></span></span></div>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Diretor Secret&aacute;rio Adjunto: Fabricio Araujo Mirandola<br />\r\nDiretor Financeiro: Jos&eacute; Luiz Albuquerque Filho<br />\r\nDiretor Financeiro Adjunto: Marcelo Denser<br />\r\nDiretora de Eventos: K&aacute;tia Canil<br />\r\nDiretora de Eventos Adjunto: Fernando F. Kertzman</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><br />\r\nDiretor de Comunica&ccedil;&atilde;o: Luiz Antonio Pereira de Souza<br />\r\nDiretor de Comunica&ccedil;&atilde;o Adjunto: Em&iacute;lio V. Barroso</big></span></span></span></div>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Diretor de Publica&ccedil;&atilde;o: Eduardo Soares de Macedo</big></span></span></span></div>\r\n<span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Diretor de Publica&ccedil;&atilde;o Adjunto: C&aacute;ssio Roberto da Silva</big></span></span></span></div>', '', '', '', 116, 'pt'),
	('Estatuto', '<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><strong><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Estatuto</big></span></span></strong><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><br />\r\n<br />\r\nCAP&Iacute;TULO I - DA DENOMINA&Ccedil;&Atilde;O, SEDE E OBJETIVO<br />\r\n<br />\r\nArt. 1o - A Associa&ccedil;&atilde;o Brasileira de Geologia de Engenharia e Ambiental - ABGE - oriunda da transforma&ccedil;&atilde;o da Associa&ccedil;&atilde;o Paulista de Geologia Aplicada - APGA, conforme deliberado em Assembl&eacute;ia Geral Extraordin&aacute;ria da APGA realizada em 1o de dezembro de 1972, na cidade de S&atilde;o Paulo, &eacute; uma associa&ccedil;&atilde;o, sem fins lucrativos, inscrita no CNPJ sob n&ordm; 43.361.997/0001-18, que se reger&aacute; por este Estatuto e pela legisla&ccedil;&atilde;o em vigor. A Associa&ccedil;&atilde;o Paulista de Geologia Aplicada, fundada em 2 de setembro de 1968, passou a denominar-se Associa&ccedil;&atilde;o Brasileira de Geologia de Engenharia - ABGE, com &acirc;mbito nacional, a partir de 1 de janeiro de 1973. Em 9 de novembro de 1999, a Associa&ccedil;&atilde;o passou a denominar-se Associa&ccedil;&atilde;o Brasileira de Geologia de Engenharia e Ambiental mantendo a sigla ABGE, sendo regida pelo C&oacute;digo Civil Brasileiro e demais legisla&ccedil;&otilde;es aplic&aacute;veis. A Associa&ccedil;&atilde;o Brasileira de Geologia de Engenharia e Ambiental - ABGE constitui o agrupamento nacional brasileiro integrante da International Association for Engineering Geology and the Environment - IAEG (Association Internationale de Geologie de l\'Ingenieur et de L\' Environment).</big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><a href="http://abge.org.br/uploads/arquivos/archivoseccion_45_estatuto_abge.pdf"><br />\r\n</a> <a href="http://abge.org.br/uploads/arquivos/archivoseccion_45_estatuto_abge.pdf"><span style="color: rgb(128, 128, 128);"><u><span style="background-color: rgb(255, 255, 255);">Clique aqui e veja o Estatudo da ABGE na &iacute;ntegra!</span></u></span></a></div>', '', '', '', 117, 'pt'),
	('Prêmios', '<div>&nbsp;</div>\r\n<div style="text-align: center;"><img align="absMiddle" width="341" height="190" alt="" src="/uploads/imgfck/image/DSC05377_premio.jpg" /></div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div><strong><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Pr&ecirc;mio Ernesto Pichler</big></span></span></span></strong><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><br />\r\n<br />\r\nEm reconhecimento do associado que tenha contribu&iacute;do continuamente para o desenvolvimento da Geologia de Engenharia e para os objetivos da ABGE.<br />\r\n<br />\r\nGe&oacute;logo Antonio Manoel dos Santos Oliveira &ndash; Pr&ecirc;mio entregue durante o 8&ordm; CBGE/1996 <br />\r\nProf. Dr. Nilson Gandolfi &ndash; Pr&ecirc;mio entregue durante o 9&ordm; CBGE/1999<br />\r\n<br />\r\nGe&oacute;logo Luiz Ferreira Vaz - Pr&ecirc;mio entregue durante o 12&ordm; CBGE/2008<br />\r\n<br />\r\n<br />\r\nGe&oacute;logo &Aacute;lvaro Rodrigues dos Santos - Pr&ecirc;mio entregue durante o 13&ordm; CBGE/2011</big></span></span></span></div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Eng. Civil Murillo Dondici Ruiz - Pr&ecirc;mio entregue durante o 14&ordm; CBGE/2013</big></span></span></span></div>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><br />\r\n<br />\r\n<strong>Pr&ecirc;mio Fernando Luiz Prandini</strong><br />\r\n<br />\r\nCriado em 31 de mar&ccedil;o de 2011, destina-se ao reconhecimento de associados da ABGE que tenham se destacado por contribui&ccedil;&atilde;o ao desenvolvimento da Geologia de Engenharia e Ambiental, notadamente nas aplica&ccedil;&otilde;es ao Meio Ambiente, e ser&aacute; atribu&iacute;do conforme o conjunto dos trabalhos e atividades do(a) indicado(a) ou por trabalho ou atividade espec&iacute;ficos.<br />\r\n<br />\r\nGe&oacute;logo Oswaldo Yujiro Iwasa - Pr&ecirc;mio entregue durante o 13&ordm; CBGE/2011</big></span></span></span></div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Ge&oacute;loga Margareth Mascarenhas Alheiros - Pr&ecirc;mio entregue durante o 14&ordm; CBGE/2013<br />\r\n&nbsp;<br />\r\n<br />\r\n<strong>Pr&ecirc;mio Lorenz Dobereiner</strong><br />\r\n<br />\r\nEm reconhecimento do associado com at&eacute; 35 anos de idade, que apresente indica&ccedil;&otilde;es promissoras, na sua carreira profissional, em rela&ccedil;&atilde;o ao desenvolvimento da Geologia de Engenharia e aos objetivos da ABGE.<br />\r\n<br />\r\nGe&oacute;logo Claudio Amaral &ndash; Pr&ecirc;mio entregue durante o 8&ordm; CBGE/1996<br />\r\n<br />\r\nEng&ordm; Ge&oacute;l&ordm; Leonardo Andrade de Souza - Pr&ecirc;mio entregue durante o 12&ordm; CBGE/2008<br />\r\n<br />\r\nGe&oacute;logo Fabricio Ara&uacute;jo Mirandola - Pr&ecirc;mio entregue durante o 13&ordm; CBGE/2011</big></span></span></span></div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Ge&oacute;loga Aline Freitas da Silva - Pr&ecirc;mio entregue durante o 14&ordm; CBGE/2013<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Pr&ecirc;mio ABGE Junior</strong><br />\r\n<br />\r\nOs pr&ecirc;mios ABGE Jr., caracter&iacute;stico das comemora&ccedil;&otilde;es do anivers&aacute;rio da ABGE destina-se ao reconhecimento de rec&eacute;m-graduados que demonstrem potencial de desenvolvimento na carreira profissional em temas das Geologias de Engenharia e Ambiental, e que tenham o Trabalho de Conclus&atilde;o de Curso (TCC) como exig&ecirc;ncia curricular para a gradua&ccedil;&atilde;o. Os &uacute;ltimos premiados est&atilde;o relacionados abaixo:<br />\r\n<br />\r\n</big></span></span></span>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><strong>Premiados em 2013 </strong></big></span></span></span></div>\r\n<span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><br />\r\n&nbsp;&nbsp;&nbsp; Primeiro Lugar: Carla de Mattos Santos (UFPA)<br />\r\n&nbsp;&nbsp;&nbsp; &ldquo;Sistema de Informa&ccedil;&otilde;es Geogr&aacute;ficas de Desastres Naturais no Estado do Amap&aacute;&rdquo;<br />\r\n&nbsp;&nbsp;&nbsp; Orientador: Prof&ordm; Dr. Claudio Szlafsztein<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; Men&ccedil;&atilde;o Honrosa: Rafael Correa de Melo (UERJ)<br />\r\n&nbsp;&nbsp;&nbsp; &ldquo;An&aacute;lise das Condicionantes Geol&oacute;gicas da Corrida de Massa do Vale do Cuib&aacute;&rdquo;<br />\r\n&nbsp;&nbsp;&nbsp; Orientador: Prof&ordm; Dr. Francisco de Assis Dourado<br />\r\n<strong><br />\r\n</strong></big></span></span></span></div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><strong>Premiados em 2008 </strong></big></span></span></span></div>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><br />\r\n&nbsp;&nbsp;&nbsp; Primeiro Lugar: Daniel Rodrigues Paim Pamplona (UFMG &ndash; Funda&ccedil;&atilde;o de Ensino de Passos)<br />\r\n&nbsp;&nbsp;&nbsp; &ldquo;Caracteriza&ccedil;&atilde;o Tecnol&oacute;gica de Rejeitos de Minera&ccedil;&otilde;es de Quartzitos para utiliza&ccedil;&atilde;o como agregado na Constru&ccedil;&atilde;o Civil&rdquo;<br />\r\n&nbsp;&nbsp;&nbsp; Orientador: Prof&ordm; Dr. Eduardo Goulart Collares<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; Men&ccedil;&atilde;o Honrosa: Ma&iacute;ra Rosa Avelino Pinto Scarance (UNESP)<br />\r\n&nbsp;&nbsp;&nbsp; &ldquo;Diretrizes para a Execu&ccedil;&atilde;o de Investiga&ccedil;&otilde;es Geol&oacute;gicas e Geot&eacute;cnicas voltadas &agrave; An&aacute;lise de Estabilidade de Encostas e Taludes&rdquo;<br />\r\n&nbsp;&nbsp;&nbsp; Orientador: Prof&ordm; Dr. Leandro Eug&ecirc;nio Silva Cerri<br />\r\n<strong><br />\r\nPremiados em 2004</strong><br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; - Primeiro lugar: &ldquo;M&eacute;todos de caracteriza&ccedil;&atilde;o de &aacute;reas potencialmente contaminadas por hidrocarbonetos de petr&oacute;leo&rdquo;, de autoria de Tiago Morais Mancini e orienta&ccedil;&atilde;o do Prof. Leandro Eug&ecirc;nio Cerri/UNESP-Rio Claro, a ser agraciado com um trof&eacute;u, um diploma e anuidade 2004 gr&aacute;tis; </big></span></span></span></div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>&nbsp;&nbsp; - Men&ccedil;&otilde;es honrosas: &ldquo;An&aacute;lise das propriedades tecnol&oacute;gicas da rocha &rdquo;Pedra Madeira&rdquo;, do munic&iacute;pio de Santo Antonio de P&aacute;dua-RJ, para poss&iacute;vel utiliza&ccedil;&atilde;o na constru&ccedil;&atilde;o civil&rdquo;, de autoria de Bruno Fidalgo Telles Rodrigues e orienta&ccedil;&atilde;o do Prof. Em&iacute;lio Velloso Barrosos/UFRJ, e, &ldquo;Processos erosivos na &aacute;rea de expans&atilde;o urbana de Passos-MG: subs&iacute;dios para elabora&ccedil;&atilde;o de uma carta de susceptibilidade &agrave; eros&atilde;o&rdquo;, de autoria de Priscila Batista e orienta&ccedil;&atilde;o do Prof. Eduardo Goulart Collares/UEMG-Passos, a serem agraciados com diplomas e anuidades de 2004 gr&aacute;tis.</big></span></span></span></div>\r\n<div>&nbsp;</div>\r\n<div><em>S&oacute;cios Honor&aacute;rios</em></div>\r\n<div>&nbsp;</div>\r\n<div>- Murillo Dondice Ruiz</div>\r\n<div>- Luiz Ferreira Vaz</div>\r\n<div>- Jaime de Azevedo Gusm&atilde;o Filho (in memoriam)</div>\r\n<div>- Instituto de Pesquisas Tecnol&oacute;gicas do Estado de S&atilde;o Paulo - IPT</div>\r\n<div>&nbsp;</div>\r\n<div><em>Pr&ecirc;mio especial de honra ao m&eacute;rito</em></div>\r\n<div>&nbsp;</div>\r\n<div>- Ronaldo Sim&otilde;es Lopez de Azambuja</div>\r\n<div>&nbsp;</div>\r\n<div><em>Pr&ecirc;mio especial ABGE</em></div>\r\n<div>&nbsp;</div>\r\n<div>- Luiz Ferreira Vaz (30 anos)</div>\r\n<div>- Guido Guidicini (30 anos)</div>\r\n<div>- Marilda Tressoldi (30 anos)</div>\r\n<div>- Renivaldo Campos (30 anos)</div>\r\n<div>- Tarc&iacute;sio Barreto Celestino (40 anos)</div>\r\n<div>- Marcos Vasconcellos (40 anos)</div>\r\n<div>- Delfino Luiz Gouveia Gambetti (40 anos)</div>\r\n<div>- Lindolfo Soares (40 anos)</div>\r\n<div>- Claudio Palmeiro do Amaral (40 anos)</div>\r\n<div>- Luiz Antonio Pereira de Souza (40 anos)</div>\r\n<div>- Silvia Maria Kitahara (40 anos)</div>\r\n<div>- Oswaldo Augusto Filho (40 anos)</div>\r\n<div>- Margareth Mascarenhas Alheiros (41 anos)</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Pr&ecirc;mios entregues durante os 30 anos da ABGR - 1998</strong></div>\r\n<div>&nbsp;</div>\r\n<div><em>Pr&ecirc;mio Karl Terzagui</em></div>\r\n<div>&nbsp;</div>\r\n<div>Entregue aos profissionais precurssores da Geologia de Engenharia.</div>\r\n<div>&nbsp;</div>\r\n<div>- Luis Flores de Moraes Rego (criador da Se&ccedil;&atilde;o de Geologia e MIinas do IPT, em 1937)</div>\r\n<div>- Tharc&iacute;sio Damy de Souza Santos (1&ordm; chefe da Se&ccedil;&atilde;o de Geologia e Minas do IPT, em 1937)</div>\r\n<div>- Ernesto Pichler (Se&ccedil;&atilde;o de Geologia e Minas do IPT, em 1937)</div>\r\n<div>- Fernando Fl&aacute;vio Marques de Almeida (Se&ccedil;&atilde;o de Geologia e Minas do IPT, em 1937)</div>\r\n<div>- Milton Vargas (Se&ccedil;&atilde;o de Geologia e Minas do IPT, em 1937)</div>\r\n<div>&nbsp;</div>\r\n<div><em>Pr&ecirc;mio Viktor Leinz</em></div>\r\n<div>&nbsp;</div>\r\n<div>Entregue aos profissionais e organiza&ccedil;&otilde;es que contribu&iacute;ram para o desenvolvimento da Geologia de Engenharia. Esta primeira ver