div>\r\n<div>- Centrais El&eacute;tricas de Minas Gerais - CEMIG</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Rio Grande do Sul</strong></div>\r\n<div>&nbsp;</div>\r\n<div>- Franciso Xavier Pires da Rocha (Iters)</div>\r\n<div>- Athos Pinto Cordeiro (UFRS)</div>\r\n<div>- Marco Aur&eacute;lio Engeldorf de Azambuja ( UFRS)</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Paran&aacute;</strong></div>\r\n<div>&nbsp;</div>\r\n<div>- Pedro Lagos Marques Filho (UFPR)</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Pernambuco</strong></div>\r\n<div>&nbsp;</div>\r\n<div>- Jaime de Azevedo Gusm&atilde;o (UFPE)</div>\r\n<div>&nbsp;</div>\r\n<div>Autores e editores de Livros Texto</div>\r\n<div>&nbsp;</div>\r\n<div>- Nivaldo Jos&eacute; Chiossi</div>\r\n<div>- Carlos Leite Maciel Filho</div>\r\n<div>- Antonio Manoel dos Santos Oliveira</div>\r\n<div>- Sergio Nertan Alves de Brito</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Homenagens P&oacute;stumas</strong></div>\r\n<div>&nbsp;</div>\r\n<div>- Ricardo Fernandes da Silva</div>\r\n<div>- Fernando Luiz Prandini</div>\r\n<div>- Enzo Totis</div>\r\n<div>- Lorenz Dobereiner</div>\r\n<div>- Nelson Infanti Junior</div>\r\n<div>- Mario Gramani Guedes</div>\r\n<div>- Ely Borges Fraz&atilde;o</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Homenagens Especiais</strong></div>\r\n<div>&nbsp;</div>\r\n<div>- Agamenon Dantas</div>\r\n<div>- Ricardo Vedovello</div>\r\n<p>&nbsp;</p>\r\n<div>&nbsp;</div>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><br />\r\n<br />\r\n</big></span></span></span></div>\r\n<p>&nbsp;</p>', '', '', '', 118, 'pt'),
	('Normas para Prêmios', '<div><a href="http://abge.org.br/uploads/arquivos/archivoseccion_36_regulamento_premiosa.pdf"><span style="color: rgb(128, 128, 128);"><u><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Veja aqui as normas e regulamentos do pr&ecirc;mio ABGE!</big></span></span></u></span></a></div>\r\n<div><span style="color: rgb(128, 128, 128);"><br />\r\n</span></div>\r\n<div><a href="/uploads/imgfck/file/Regulamento_Premio_ABGE_2013(1).pdf"><span style="color: rgb(128, 128, 128);"><u><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Veja aqui o regulamento do Pr&ecirc;mio ABGE Junior</big></span></span></u></span></a></div>', '', '', '', 119, 'pt'),
	('Associe-se', '<p style="text-align: left;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>A ABGE possui as categorias de associados abaixo:<br />\r\n<br />\r\n<strong>Afiliado:</strong> Estudante de gradua&ccedil;&atilde;o ou t&eacute;cnico de n&iacute;vel m&eacute;dio.<br />\r\n<strong>Titular:</strong> N&iacute;vel universit&aacute;rio (graduado, mestrado e doutorado).<br />\r\n<strong>S&ecirc;nior: </strong>associados com idade entre 65 e 75 anos.<br />\r\n<strong>Master:</strong> associados com 76 anos ou maiss.<br />\r\n<strong><br />\r\nPatrocinador:</strong> Empresas/Institui&ccedil;&otilde;es</big></span></span></span></p>\r\n<p style="text-align: left;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Platina<br />\r\nOuro<br />\r\nPrata</big></span></span></span></p>\r\n<p style="text-align: left;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><strong>Patrocinadores Coletivos: </strong>prefeituras e entidades da sociedade civil</big></span></span></span></p>\r\n<p><span style="color: rgb(128, 128, 128);"><span style="font-family: Verdana;">Esmeralda<br />\r\nRubi<br />\r\nCristal</span></span></p>\r\n<p style="text-align: left;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big> &nbsp;<strong><br />\r\nVALORES ANUIDADE 2015 (at&eacute; o dia 10 de abril de 2015)</strong><br />\r\n&nbsp;</big></span></span></span></p>\r\n<p style="text-align: left;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><strong>Pessoa F&iacute;sica</strong></big></span></span></span></p>\r\n<p><span style="font-family: Verdana;"><span style="color: rgb(128, 128, 128);">Titular (N&iacute;vel Universit&aacute;rio)&nbsp;&nbsp;&nbsp; R$ 205,00<br />\r\nAfiliado (Estudante)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; R$ 100,00<br />\r\nSenior (associado com idade entre 65 e 75 anos) R$ 100,00<br />\r\nMaster (associado acima dos 76 anos) ISENTO</span></span></p>\r\n<p><span style="font-family: Verdana;"><span style="color: rgb(128, 128, 128);"><strong>S&oacute;cios Patrocinadores Coletivos</strong></span></span></p>\r\n<p style="text-align: left;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>At&eacute; 50 mil habitantes &ndash; Categoria Cristal &ndash;&nbsp; R$ 415,00<br />\r\nEntre 50 mil e 500 mil habitantes &ndash; Categoria Rubi &ndash;&nbsp; R$ 625,00<br />\r\nAcima de 500 mil habitantes &ndash; Categoria Esmeralda &ndash;&nbsp; R$ 830,00</big></span></span></span></p>\r\n<p style="text-align: left;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><strong>S&oacute;cios Patrocinadores</strong></big></span></span></span></p>\r\n<p style="text-align: left;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Patrocinador Prata (Empresa/Institui&ccedil;&atilde;o)&nbsp;&nbsp;&nbsp; R$ 1.440,00<br />\r\nPatrocinador Ouro (Empresa/Institui&ccedil;&atilde;o)&nbsp;&nbsp;&nbsp;&nbsp; R$ 2.720,00<br />\r\nPatrocinador Platina (Empresa/Institui&ccedil;&atilde;o)&nbsp; R$ 4.500,00</big></span></span></span></p>\r\n<p style="text-align: left;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><strong><br />\r\nVANTAGENS DO S&Oacute;CIO ABGE</strong><br />\r\n<br />\r\n- Receber&aacute; todas as publica&ccedil;&otilde;es editadas pela entidade durante o per&iacute;odo de filia&ccedil;&atilde;o (livros, tradu&ccedil;&otilde;es, artigos t&eacute;cnicos, anais de simp&oacute;sios e congressos);<br />\r\n<br />\r\n- Ter&aacute; desconto na aquisi&ccedil;&atilde;o de publica&ccedil;&otilde;es editadas pela entidade;<br />\r\n<br />\r\n- Receber&aacute; a RBGEA, Revista Informativa e Informes T&eacute;cnicos;<br />\r\n<br />\r\n- Ter&aacute; desconto na inscri&ccedil;&atilde;o dos eventos promovidos pela ABGE e entidades parceiras;<br />\r\n<br />\r\n- Ter&aacute; acesso a conte&uacute;do restrito na homepage.<br />\r\n&nbsp;</big></span></span></span></p>\r\n<p style="text-align: center;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><br />\r\n<a href="http://abge.org.br/uploads/arquivos/archivoseccion_225_regulamento_abge_est.pdf "><br />\r\n<span style="color: rgb(128, 128, 128);"><u>Regulamento Afiliado Estudante</u></span></a><span style="color: rgb(128, 128, 128);"><br />\r\n<br />\r\n</span><a href="http://abge1.hospedagemdesites.ws/uploads/arquivos/archivoseccion_224_regulamentosciopatro.pdf "><span style="color: rgb(128, 128, 128);">Regulamento S&oacute;cio Patrocinador</span></a></big><span style="color: rgb(128, 128, 128);"><big><br />\r\n</big></span></span></span></span></p>\r\n<p style="text-align: center;"><a href="http://abge1.hospedagemdesites.ws/uploads/arquivos/archivoseccion_223_regulamentosciocolet.pdf "><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><span style="color: rgb(128, 128, 128);">Regulamento S&oacute;cio Coletivo</span></big></span></span></span></a></p>\r\n<p style="text-align: center;"><a href="http://abge.org.br/uploads/arquivos/archivoseccion_222_modelodeleimunicipal.pdf "><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Minuta de Lei Municipal</big></span></span></span><br />\r\n</a></p>', '', '', '', 138, 'pt'),
