	('Revista RBGEA', '<div><span style="background-color: rgb(192, 192, 192);"><span style="background-color: rgb(255, 255, 255);"><span style="color: rgb(192, 192, 192);"><strong><span style="color: rgb(128, 128, 128);">Revista Brasileira de Geologia de Engenharia e Ambiental</span></strong></span></span></span></div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>A revista cient&iacute;fica ter&aacute; anualmente tr&ecirc;s edi&ccedil;&otilde;es eletr&ocirc;nicas e um volume especial impresso com todos os trabalhos.&nbsp;</big></span></span></span></div>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>&nbsp;</big></span></span></span></div>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Espera-se que este peri&oacute;dico atinja suas fun&ccedil;&otilde;es estreitando os la&ccedil;os entre os profissionais que atuam na forma&ccedil;&atilde;o e pesquisa com aqueles que atuam em empresas publicas e privadas que tornaram a Geologia de Engenharia e Ambiental importante para a sociedade nos mais diferentes aspectos; e que tamb&eacute;m venha dotar os estudantes e profissionais de subs&iacute;dios t&eacute;cnicos que os torne cada dia melhores.&nbsp;</big></span></span></span></div>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>&nbsp;</big></span></span></span></div>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Poder&atilde;o ser submetidos artigos t&eacute;cnico-cient&iacute;ficos, teses de mestrado e doutorado, al&eacute;m do estudo de case.</big></span></span></span></div>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="fo