	('Regulamento', '<div style="text-align: justify;"><strong><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>REVISTA DE GEOLOGIA DE ENGENHARIA E AMBIENTAL&nbsp;</big></span></span></span></strong></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Equipe Editorial</big></span></span></span></div>\r\n<div style="text-align: justify;">\r\n<p><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>- Editores :&nbsp; Prof. Dr. Em&iacute;lio Velloso Barroso <br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Prof. Dra. K&aacute;tia Canil <br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Prof. Dra. Malva Andrea Mancuso <br />\r\n</big></span></span></span></p>\r\n</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>II - Pol&iacute;ticas &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>1 - Foco e Escopo&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>A Revista de Geologia de Engenharia e Ambiental (REGEA) destina-se &agrave; divulga&ccedil;&atilde;o de&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>investiga&ccedil;&otilde;es, estudos e solu&ccedil;&otilde;es de problemas de engenharia e ambientais decorrentes&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>da intera&ccedil;&atilde;o entre a Geologia (e as Ci&ecirc;ncias da Terra) e as atividades humanas,&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>incluindo aspectos relevantes relacionados &agrave; Engenharia Civil, Minera&ccedil;&atilde;o, Recursos&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>H&iacute;dricos, Cartografia Geot&eacute;cnica, Gest&atilde;o de Riscos e Desastres Naturais, Preven&ccedil;&atilde;o e&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Remedia&ccedil;&atilde;o de &Aacute;reas Degradadas e Contaminadas, Planejamento Territorial e&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Ambiental, Banco de Dados, Casos Hist&oacute;ricos relacionados &agrave; Geologia de Engenharia e&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Ambiental; e temas cient&iacute;ficos de interesse amplo e car&aacute;ter original relacionada com a&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Geologia de Engenharia e Ambiental, inclusive processos modernos e novas t&eacute;cnicas de&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>campo e laborat&oacute;rio. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>A REGEA &eacute; a revista t&eacute;cnica e cient&iacute;fica oficial da Associa&ccedil;&atilde;o Brasileira de Geologia&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>de Engenharia e Ambiental, que estar&aacute; inserida no SEER da EESC/USP (Departamento&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>de Geot&eacute;cnica). &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>TEMAS RELACIONADOS: Ci&ecirc;ncias da Terra, Geot&eacute;cnica, &nbsp;Geografia, Engenharia&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Civil e Ambiental, Conserva&ccedil;&atilde;o Ambiental e Ci&ecirc;ncias Naturais. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>A &nbsp;REGEA &nbsp;publica &nbsp;Artigos, Discuss&otilde;es, &nbsp;Resenhas de Livros &nbsp;e &nbsp;Not&iacute;cias &nbsp;de cunho&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Geocient&iacute;fico. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Os textos podem ser redigidos em portugu&ecirc;s ou espanhol. Em casos espec&iacute;ficos podem&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>ser aceitos os escritos em ingl&ecirc;s e franc&ecirc;s. &nbsp;Os artigos ser&atilde;o publicados na forma on-line. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>A Periodicidade ser&aacute; quadrimestral. Cada edi&ccedil;&atilde;o (n&uacute;mero) corrente dever&aacute; ter 10&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>artigos, ou a crit&eacute;rios dos Editores. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Haver&aacute; a publica&ccedil;&atilde;o anual de 1 volume com 3 edi&ccedil;&otilde;es (n&uacute;meros).&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Ser&atilde;o aceitos:</big></span></span></span> <span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Artigos &nbsp;&ndash; modo principal de publica&ccedil;&atilde;o e deve conter at&eacute; 10.000 palavras, incluindo&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>refer&ecirc;ncias bibliogr&aacute;ficas. N&atilde;o ser&atilde;o aceitos artigos particionados (Ex. parte 1, parte 2).&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Os artigos dever&atilde;o permitir a leitura, independente de um artigo anterior. </big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Discuss&otilde;es &ndash; se&ccedil;&atilde;o destinada a divulgar coment&aacute;rios sobre &nbsp;Artigos &nbsp;publicados&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>recentemente, seguida da R&eacute;plica &nbsp;pelo(s) autor(es) do trabalho de origem. Ambos os&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>textos devem ser breves, objetivos e concisos. </big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Resenha de Livros - As resenhas s&atilde;o publicadas a convite do Editor. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Not&iacute;cias de cunho Geol&oacute;gico - Trata-se de noticias que mere&ccedil;am r&aacute;pida comunica&ccedil;&atilde;o. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>A n&atilde;o observ&acirc;ncia da extens&atilde;o de qualquer das formas de divulga&ccedil;&atilde;o da &nbsp;REGEA&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>implicar&aacute; na devolu&ccedil;&atilde;o aos autores para adapta&ccedil;&atilde;o.&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>2 - Pol&iacute;ticas de Se&ccedil;&atilde;o&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Artigos:&nbsp; </big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>- Submiss&otilde;es Abertas, &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>- Indexado, &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>- Avaliado por Pares &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Discuss&otilde;es &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>- Submiss&otilde;es Abertas, &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>- Indexado &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Resenhas de Livros &nbsp;- Convite dos Editores, &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>- Indexado &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Not&iacute;cias de Cunho Geol&oacute;gico &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>- Submiss&otilde;es Abertas &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>3 - Processo de Avalia&ccedil;&atilde;o por Pares:</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>1 - Avalia&ccedil;&atilde;o por pares: Artigos ser&atilde;o submetidos &agrave; an&aacute;lise cr&iacute;tica de pelo menos 3&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>(Tr&ecirc;s) revisores e, sua publica&ccedil;&atilde;o ser&aacute; considerada quando dois consultores forem&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>favor&aacute;veis. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>2 - Tipo de avalia&ccedil;&atilde;o: Ser&aacute; adotado o sistema de avalia&ccedil;&atilde;o cega, ou seja, os revisores&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>receber&atilde;o os manuscritos sem a identifica&ccedil;&atilde;o dos autores. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>3 - Tempo de tramita&ccedil;&atilde;o dos manuscritos: &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Os revisores ter&atilde;o 5 dias para aceitar ou n&atilde;o fazer o relato do manuscrito. No caso de&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>aceite, ter&atilde;o 30 dias para realizar o relato. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>O(s)s autor(es) ter&aacute;(&atilde;o) outros 20 dias para realizem as corre&ccedil;&otilde;es &nbsp;e ajustes&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>necess&aacute;rios no manuscrito, ap&oacute;s receberem os relatos, via editores. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Artigos com pequenas corre&ccedil;&otilde;es de forma e/ou conte&uacute;do: &nbsp;Ap&oacute;s o envio do&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>manuscrito corrigido pelo(s) autor(es), as corre&ccedil;&otilde;es ser&atilde;o conferidas pelos editores. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Artigos com importantes corre&ccedil;&otilde;es de forma e/ou conte&uacute;do: O manuscrito com as&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>corre&ccedil;&otilde;es dever&aacute; retornar para os consultores (via editores), os quais ter&atilde;o 20 dias para&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>avaliar as corre&ccedil;&otilde;es, os quais poder&atilde;o sugerir novas corre&ccedil;&otilde;es ou optar por sua&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>aceita&ccedil;&atilde;o para publica&ccedil;&atilde;o. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Leitura e corre&ccedil;&atilde;o de provas: &nbsp;Ap&oacute;s a emiss&atilde;o do aceite e da diagrama&ccedil;&atilde;o do&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>manuscrito, este retornar&aacute; aos autores para leitura e corre&ccedil;&atilde;o de provas, o que dever&aacute; ser&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>realizado em 48 horas. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>4 - Prerrogativas dos autores: &nbsp;Solicitar o n&atilde;o envio dos trabalhos a certas institui&ccedil;&otilde;es ou cidades, com o intuito de&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>evitar poss&iacute;veis conflitos de interesse cient&iacute;fico. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>5 - Rela&ccedil;&atilde;o de Revisores:&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Verificar na p&aacute;gina da RBGEA, no link da ABGE, o &iacute;tem &quot;Corpo Editorial e Contato&quot;. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>6 - Os revisores &quot;ad hoc&quot; foram selecionados segundo os crit&eacute;rios:&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>&Eacute; profissional ou pesquisador com not&oacute;rio saber; &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Produziu trabalhos cient&iacute;ficos (e/ou livros) de refer&ecirc;ncia nos &uacute;ltimos 5 anos; &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Recebeu pr&ecirc;mios e t&iacute;tulos relevantes da ABGE ou entidades similares; &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>&Eacute; consultor &quot;ad hoc&quot; de peri&oacute;dicos nacionais ou reconhecidos peri&oacute;dicos internacionais&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>na &aacute;rea de Geologia de Engenharia e Ambiental; &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Pertence a uma &aacute;rea emergente da Geologia de Engenharia e/ou Ambiental. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>7 - Das responsabilidades&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Os dados e conceitos cient&iacute;ficos emitidos, bem como a exatid&atilde;o das refer&ecirc;ncias&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>bibliogr&aacute;ficas, s&atilde;o de exclusiva responsabilidade do(s) autor(es). &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>4 - Periodicidade&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>A Periodicidade ser&aacute; &nbsp;quadrimestral, com &nbsp;a publica&ccedil;&atilde;o anual de 1 volume com 3&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>edi&ccedil;&otilde;es (n&uacute;meros). Os artigos ser&atilde;o publicados individualmente, na forma on-line,&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>adicionando-se os mesmos ao sum&aacute;rio atual quando conclu&iacute;dos. Depois de atingidos 15&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>artigos, ou a crit&eacute;rios dos Editores, ser&aacute; fechada a edi&ccedil;&atilde;o (n&uacute;mero) corrente, a qual ser&aacute;&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>tamb&eacute;m publicada em outras m&iacute;dias usuais (impresso ou CD). &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>5 - Pol&iacute;tica de Acesso Livre&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Esta revista oferece acesso livre imediato ao seu conte&uacute;do, seguindo o princ&iacute;pio de&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>que disponibilizar gratuitamente o conhecimento cient&iacute;fico ao p&uacute;blico proporciona&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>maior democratiza&ccedil;&atilde;o do conhecimento. &nbsp;</big></span></span></span></div>\r\n<p>&nbsp;</p>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>6 - Provas&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Provas das publica&ccedil;&otilde;es ser&atilde;o remetidas aos autores &nbsp;antes da edi&ccedil;&atilde;o eletr&ocirc;nica e&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>vers&atilde;o impressa final. O(s) autor(es) ter&aacute;(&atilde;o) 48 horas para reenviar as sugest&otilde;es de&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>corre&ccedil;&otilde;es das provas. Caso n&atilde;o ocorra manifesta&ccedil;&atilde;o(&otilde;es) do(s) autor(es), a prova ser&aacute;&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>considerada aceita, n&atilde;o cabendo corre&ccedil;&otilde;es. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>7 - Separatas&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Ser&atilde;o enviadas 5 separatas ao autor principal ou indicado por este. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>III - Submiss&otilde;es &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>CADASTRO DE USU&Aacute;RIOS &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>O cadastro no sistema e posterior acesso ou login s&atilde;o obrigat&oacute;rios para submiss&atilde;o como&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>tamb&eacute;m para verificar o est&aacute;gio das submiss&otilde;es. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Diretrizes para Autores&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>PREPARA&Ccedil;&Atilde;O PARA SUBMISS&Atilde;O.&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Tipo e Tamanho de Arquivo: O texto do manuscrito dever&aacute; ser enviado em&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>arquivo Word &nbsp;(.doc), &nbsp;em separado, com os locais de inser&ccedil;&atilde;o das figuras assinalados, seguido das respectivas legendas. As &nbsp;ilustra&ccedil;&otilde;es &nbsp;dever&atilde;o ser&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>enviadas em arquivo .tif, tamb&eacute;m em separado (uma ilustra&ccedil;&atilde;o por arquivo). O&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>mesmo procedimento dever&aacute; ser adotado para as tabelas, em arquivo. doc. O&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>artigo n&atilde;o poder&aacute; ultrapassar a 10.000 palavras ou 20 p&aacute;ginas, incluindo t&iacute;tulo,&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>autores, institui&ccedil;&otilde;es e e-mail, resumo e palavras-chave, abstract e keywords,&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>texto, figuras, tabelas, mapas, referencias e legendas. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Nenhum arquivo poder&aacute; ultrapassar a 10Mb de tamanho. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Forma de envio: &nbsp;O &nbsp;texto &nbsp;dever&aacute; ser enviado junto com as &nbsp;ilustra&ccedil;&otilde;es&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>(inclusive tabelas) para o e-mail: rbgea@rbgea.org.br</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Artigos</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Organiza&ccedil;&atilde;o de artigos: dever&aacute; constar em seq&uuml;&ecirc;ncia, o t&iacute;tulo, nome completo&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>do(s) autor(es), institui&ccedil;&atilde;o e e-mail (nome da institui&ccedil;&atilde;o, cidade, estado, pa&iacute;s e&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>e-mail. Para alunos de mestrado ou doutorado, indicar &quot;Programa de P&oacute;s-gradua&ccedil;&atilde;o&quot;, institui&ccedil;&atilde;o, e demais informa&ccedil;&otilde;es acima), resumo e palavras-chave,&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>abstract e keywords, texto completo, refer&ecirc;ncias, ilustra&ccedil;&otilde;es e tabelas. O texto&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>deve conter, preferencialmente: introdu&ccedil;&atilde;o, materiais e m&eacute;todos, resultados,&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>discuss&atilde;o, conclus&otilde;es e agradecimentos. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Hierarquiza&ccedil;&atilde;o dos t&iacute;tulos e subt&iacute;tulos: Deve seguir o padr&atilde;o: &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>N&iacute;vel 1 &ndash; EM NEGRITO, TODAS AS LETRAS MAI&Uacute;SCULAS. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>N&iacute;vel 2 &ndash; Em negrito; a primeira letra da primeira palavra em mai&uacute;scula e as&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>demais min&uacute;sculas. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>N&iacute;vel 3 - IT&Aacute;LICO, N&Atilde;O NEGRITO, TODAS AS LETRAS MAI&Uacute;SCULAS. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>N&iacute;vel 4 &ndash; It&aacute;lico, n&atilde;o negrito; a primeira letra da primeira palavra em mai&uacute;scula&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>e as demais min&uacute;sculas. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Agradecimentos &ndash; &nbsp;Negrito e it&aacute;lico &nbsp;(apenas o subt&iacute;tulo). &nbsp;Refer&ecirc;ncias &nbsp;&ndash;&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Negritas e min&uacute;sculas (apenas o subt&iacute;tulo). &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Manter um espa&ccedil;o simples entre itens e subitens do texto. Utilizar fonte Times&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>New Roman, tamanho 11. &nbsp;A indica&ccedil;&atilde;o da inser&ccedil;&atilde;o das ilustra&ccedil;&otilde;es (figuras, tabelas, etc) no texto dever&aacute; ser em&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>posi&ccedil;&atilde;o o mais pr&oacute;ximo poss&iacute;vel de sua primeira cita&ccedil;&atilde;o. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Formato do Resumo, Resumen e o Abstract: N&atilde;o poder&atilde;o exceder 300&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>palavras cada, em par&aacute;grafo &uacute;nico, fonte Times New Roman, corpo 10, espa&ccedil;o&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>simples (1,0) e serem seguidos de palavras-chaves, palabras claves e keywords&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>(no m&iacute;nimo 3 e m&aacute;ximo 5), respectivamente. Artigos em portugu&ecirc;s, espanhol ou&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>franc&ecirc;s dever&atilde;o ter o t&iacute;tulo vertido para o idioma ingl&ecirc;s, em MAI&Uacute;SCULO E&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>IT&Aacute;LICO, colocado ap&oacute;s a palavra Abstract. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Formato do texto: Editar o texto em Word, fonte Times New Roman, corpo 11,&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>espa&ccedil;o simples, papel A4, orienta&ccedil;&atilde;o em retrato e editado em apenas uma&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>coluna. As margens dever&atilde;o ter as seguintes medidas: superior: 2,0; inferior 2,0;&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>esquerda 3,0 e direita 2,0. Digitar as tabelas em documentos word. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Abrevia&ccedil;&otilde;es: Devem ser evitadas ou mantidas ao m&iacute;nimo. Se usadas, devem ser&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>definidas na primeira vez que forem mencionadas e n&atilde;o devem ser utilizadas no&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>t&iacute;tulo, resumo e abstract. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Ilustra&ccedil;&otilde;es: A vers&atilde;o impressa da RBG publica ilustra&ccedil;&otilde;es em preto e branco e&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>tons de cinza. A vers&atilde;o &ldquo;on line&rdquo; publica&ccedil;&otilde;es coloridas. As fontes usadas para&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>textos sobre fotografias deve ser uma da fam&iacute;lia da Helv&eacute;tica. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>As ilustra&ccedil;&otilde;es gr&aacute;ficas, fotogr&aacute;ficas e fotomicrogr&aacute;ficas ser&atilde;o numeradas&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>seq&uuml;encialmente, na ordem de sua cita&ccedil;&atilde;o no texto e consideradas, mesmo pranchas,&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>indiscriminadamente como Figuras. Dever&atilde;o ser separadas do texto por uma linha. N&atilde;o&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>ser&atilde;o aceitos encartes. Fotografias de afloramentos dever&atilde;o apresentar barra de escala e&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>indica&ccedil;&atilde;o do norte. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Letreiros e s&iacute;mbolos das ilustra&ccedil;&otilde;es &nbsp;devem ter dimens&otilde;es adequadas para permitir&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>legibilidade. &nbsp;As ilustra&ccedil;&otilde;es &nbsp;dever&atilde;o ter &nbsp;larguras &nbsp;m&iacute;nimas de &nbsp;9 &nbsp;ou &nbsp;18 &nbsp;cent&iacute;metros&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>(permitir diagrama&ccedil;&atilde;o em uma ou duas colunas). Explicar todos os s&iacute;mbolos. Escalas&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>gr&aacute;ficas, se necess&aacute;rias, devem ser colocadas dentro da &aacute;rea das ilustra&ccedil;&otilde;es. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>As Tabelas devem ser auto-explicativas, com as laterais abertas, concisas e numeradas&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>seq&uuml;encialmente. Devem ser elaboradas em Times New Roman, corpo 9. &nbsp;As legendas das ilustra&ccedil;&otilde;es dever&atilde;o ser redigidas com a mesma fonte do texto e corpo.&nbsp; </big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Formato das Figuras: S&oacute; ser&atilde;o aceitas figuras .tif, devendo ter resolu&ccedil;&atilde;o m&iacute;nima de&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>300dpi, podendo ser comprimidas em LZW. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>F&oacute;rmulas e Equa&ccedil;&otilde;es: Numerar as f&oacute;rmulas e equa&ccedil;&otilde;es seq&uuml;encialmente &agrave;&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>direita, com n&uacute;meros ar&aacute;bicos entre par&ecirc;nteses e, no texto, referir como&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>&ldquo;equa&ccedil;&atilde;o (1)&rdquo;, etc. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Cita&ccedil;&otilde;es no corpo do texto: Deve-se seguir os formatos do seguinte exemplo:&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>...&quot;Cunha (1985) interpreta a fei&ccedil;&atilde;o como uma estrutura de resfriamento&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>magm&aacute;tico precoce, mas outros (Lima 1986, Fonseca &nbsp;et al. 1989, Ferreira &amp;&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Ara&uacute;jo 1994) como uma fei&ccedil;&atilde;o tardia&quot;. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Refer&ecirc;ncias: Relat&oacute;rios internos s&atilde;o ser&atilde;o aceitos &nbsp;nas refer&ecirc;ncias, com&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>excess&atilde;o daqueles que s&atilde;o amplamente difundidos na comunidade cientifica e&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>autorizados pelos consultores &nbsp;ad hoc. &nbsp;As refer&ecirc;ncias dever&atilde;o ser feitas em&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><s