ica.com.br/users/gmoura/refere.html. Acessado em 9 out 1996. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>INPE - INSTITUTO DE PESQUISAS ESPACIAIS 2000. El Ninho. Dispon&iacute;vel em&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>http://www.inpe.dpi/ elninho.html. Acessado em 14 jun 2000. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Agradecimentos. Devem constar de um par&aacute;grafo &agrave; parte, colocado antes das&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>refer&ecirc;ncias.&nbsp; </big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Discuss&otilde;es&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Resenha de Livros S&atilde;o publicadas a convite dos Editores. Uma resenha dever&aacute; conter: t&iacute;tulo; resumo de, no&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>m&aacute;ximo, 250 palavras, arquivo com at&eacute; 10MB de tamanho; texto com no m&aacute;ximo 5&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>p&aacute;ginas, exclu&iacute;das as refer&ecirc;ncias bibliogr&aacute;ficas; e n&atilde;o mais que 60 refer&ecirc;ncias. Dever&aacute;&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>conter, ainda, o(s) nome(es) do(s) autor(es), a institui&ccedil;&atilde;o a que pertencem, endere&ccedil;o, email. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Not&iacute;cias de cunho Geol&oacute;gico &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>FORMATO FINAL PARA PUBLICA&Ccedil;&Atilde;O &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Manuscrito final para publica&ccedil;&atilde;o &eacute; aquele com as corre&ccedil;&otilde;es feitas e aceitas pelos&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>consultores e editores. Dever&aacute; ser mantida a mesma formata&ccedil;&atilde;o da vers&atilde;o submetida.&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Os &quot;tipos e tamanhos de arquivos&quot; ser&atilde;o os aqueles &nbsp;indicados nos procedimentos de&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>submiss&atilde;o (ver itens (a) e (b) em &quot;1. PREPARA&Ccedil;&Atilde;O PARA SUBMISS&Atilde;O&quot; no in&iacute;cio&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>desta se&ccedil;&atilde;o. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>IV - Itens de Verifica&ccedil;&atilde;o para Submiss&atilde;o &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Como parte do processo de submiss&atilde;o, os autores s&atilde;o obrigados a verificar a&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>conformidade da submiss&atilde;o em rela&ccedil;&atilde;o a todos os itens listados a seguir. As submiss&otilde;es&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>que n&atilde;o estiverem de acordo com as normas ser&atilde;o devolvidas aos autores. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>A contribui&ccedil;&atilde;o &eacute; original e in&eacute;dita, e n&atilde;o foi submetida para publica&ccedil;&atilde;o em outra&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>revista; caso contr&aacute;rio, justificar em &quot;Coment&aacute;rios ao Editor&quot;. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>O arquivo para submiss&atilde;o est&aacute; em formato Microsoft &nbsp;Word, bem como uma c&oacute;pia em pdf, com texto em espa&ccedil;o&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>simples e fonte de 11 pontos, em Times New Roman. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>O manuscrito, quando submetido, dever&aacute; ser enviado &nbsp;em arquivo contendo apenas o&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>texto (formato doc), e cada ilustra&ccedil;&atilde;o e tabela dever&aacute; vir em arquivo separado (formato&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>tif para as figuras). Id&ecirc;ntico procedimento ser&aacute; adotado no envio do manuscrito final&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>para publica&ccedil;&atilde;o, ap&oacute;s as &uacute;ltimas corre&ccedil;&otilde;es. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Nenhum arquivo poder&aacute; ultrapassar a 10Mb, tanto de texto como de ilustra&ccedil;&atilde;o. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>O artigo n&atilde;o foi particionado, permitindo o entendimento integral e independente do seu&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>conte&uacute;do. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>O artigo n&atilde;o excede a 10.000 palavras e 20 p&aacute;ginas em documento word.&nbsp;</big></span></span></span></div>\r\n<p>&nbsp;</p>', '', '', '', 131, 'pt'),
