	('Eventos - Apoio ABGE', '<div style="width:730px; position:relative;"><br />\r\n<div style="text-transform:uppercase;font-size:16px; color:#999; text-align:left;">apoio</div>\r\n<div style="width:730px; position:relative;"><!--Linha 1-->  <!--Linha 1 Fim-->  <!--Linha 2-->  <!--Linha 2 Fim-->    <!--Linha 4-->  <!--Linha 4 Fim-->   <!--Linha 6-->  <!--Linha 6 Fim-->  <!--Linha 7-->  <!--Linha 7 Fim-->  <!--Linha 8-->  <!--Linha 8 Fim-->  <!--Linha 9-->  <!--Linha 9 Fim-->  <!--Linha 10-->  <!--Linha 10 Fim-->  <!--Linha 11-->  <!--Linha 11 Fim-->  <!--Linha 12-->  <!--Linha 12 Fim-->  <!--Linha 13-->  <!--Linha 13 Fim-->  <!--Linha 14-->  <!--Linha 14 Fim-->  <!--Linha 15-->  <!--Linha 15 Fim-->  <!--Linha 16-->  <!--Linha 16 Fim-->  <!--Linha 17-->  <!--Linha 17 Fim-->  <!--Linha 18-->  <!--Linha 18 Fim-->  <!--Linha 19-->  <!--Linha 19 Fim-->  <!--Linha 20-->  <!--Linha 20 Fim-->  <!--Linha 21-->  <!--Linha 21 Fim-->  <!--Linha 22-->  <!--Linha 22 Fim-->  <!--Linha 23-->  <!--Linha 23 Fim-->  <!--Linha 24-->  <!--Linha 24 Fim-->  <!--Linha 25-->  <!--Linha 25 Fim-->  <!--Linha 26-->  <!--Linha 26 Fim-->  <!--Linha 27-->  <!--Linha 27 Fim-->  <!--Linha 28-->  <!--Linha 28 Fim--></div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div style="width:158px; margin-top:20px; border:1px #999 dotted; height:130px; float:left; margin-bottom:20px; position:relative; margin-right:30px; text-align:center;"><a target="_blank" href="http://www.wtc2014.com.br/"><img width="150" height="104" border="0" src="/uploads/imgfck/image/wtc2014.jpg" alt="" /></a></div>\r\n<div style="width:158px; margin-top:20px; border:1px #999 dotted; height:130px; float:left; margin-bottom:20px; position:relative; margin-right:30px; text-align:center;"><a target="_blank" href="http://www.mtps.org.br/"><img width="125" height="115" border="0" alt="" src="/uploads/imgfck/image/bannermtps_136_125.jpg" /></a></div>\r\n<div style="width:158px; margin-top:20px; border:1px #999 dotted; height:130px; float:left; margin-bottom:20px; position:relative; margin-right:30px; text-align:center;"><a target="_blank" href="http://www.expolixo.com.br/"><img width="127" height="82" border="0" src="/uploads/imgfck/image/selo-expolixo.jpg" alt="" /></a></div>\r\n<p>&nbsp;</p>\r\n<div style="width:158px; margin-top:20px; border:1px #999 dotted; height:130px; float:left; margin-bottom:20px; position:relative; margin-right:30px; text-align:center;"><a target="_blank" href="http://www.47cbg.com.br"><img width="127" height="125" border="0" src="/uploads/imgfck/image/47cbg23.jpg" alt="" /></a></div>\r\n<div style="width:158px; margin-top:20px; border:1px #999 dotted; height:130px; float:left; margin-bottom:20px; position:relative; margin-right:30px; text-align:center;"><img width="127" height="127" src="/uploads/imgfck/image/ABAS.jpg" alt="" /></div>\r\n<div style="width:158px; margin-top:20px; border:1px #999 dotted; height:130px; float:left; margin-bottom:20px; position:relative; margin-right:30px; text-align:center;"><a href="http://www.saneamentoaguasdoamanha.com"><img width="127" height="127" src="/uploads/imgfck/image/banner%20250%20x%20250.png" alt="" /></a></div>\r\n<p>&nbsp;&nbsp;</p>\r\n<div style="width:158px; margin-top:20px; border:1px #999 dotted; height:130px; float:left; margin-bottom:20px; position:relative; margin-right:30px; text-align:center;"><a href="http://www.sefe8.com.br"><img width="127" height="127" alt="" src="/uploads/imgfck/image/logo_sefe8_pt.jpg" /></a></div>\r\n<p>&nbsp; </p>', '', '', '', 136, 'pt'),
	('Entidades', '<div style="width:730px; position:relative;"><!--Linha 1-->\r\n<div style="width:158px; border:1px #999 dotted; height:130px; float:left; margin-bottom:20px; position:relative; margin-right:30px; text-align:center;">\r\n<div style="width:158px; border:1px #999 dotted; height:130px; float:left; margin-bottom:20px; margin-right:30px; margin-bottom:20px; text-align:center;"><a target="_blank" href="http://www.revistafundacoes.com.br"><img width="150" height="96" border="0" alt="" src="http://abge1.hospedagemdesites.ws/uploads/imagens/apoio/RevistadeFundacoes.jpg" /></a></div>\r\n</div>\r\n<!--Linha 1 Fim-->  <!--Linha 2-->  <!--Linha 2 Fim-->  <!--Linha 3-->\r\n<div style="width:158px; border:1px #999 dotted; height:130px; float:left; margin-bottom:20px; margin-right:30px; text-align:center;"><a href="http://www.geologiabr.com"><img width="150" height="96" alt="" src="/uploads/imgfck/image/Logo%20Com%20Marca%20Registrada%202_site.jpg" /></a></div>\r\n<!--Linha 3 Fim--></div>\r\n<div style="width:158px; border:1px #999 dotted; height:130px; float:left; margin-bottom:20px; margin-right:30px; text-align:center;"><a target="_blank" href="http://www.sugeologia.org/"><img width="150" height="96" border="0" alt="" src="http://abge1.hospedagemdesites.ws/uploads/imagens/apoio/SUG.jpg" /></a></div>\r\n<p>&nbsp;</p>', '', '', '', 137, 'pt'),
	('Diretrizes para Autores', '<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><strong><big>PREPARA&Ccedil;&Atilde;O PARA SUBMISS&Atilde;O</big></strong></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Tipo e Tamanho de Arquivo: O texto do manuscrito dever&aacute; ser enviado&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>em arquivo &nbsp;Word (.doc), &nbsp;em separado, com os locais de inser&ccedil;&atilde;o das&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>figuras assinalados, seguido das respectivas legendas. As ilustra&ccedil;&otilde;es</big></span></span></span> <span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>dever&atilde;o ser enviadas em arquivo .tif, tamb&eacute;m em separado (uma ilustra&ccedil;&atilde;o&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>por arquivo). O mesmo procedimento dever&aacute; ser adotado para as tabelas, em&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>arquivo. doc.&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>O artigo n&atilde;o poder&aacute; ultrapassar a 10.000 palavras ou 20 p&aacute;ginas, incluindo t&iacute;tulo,&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>autores, institui&ccedil;&otilde;es e e-mail, resumo e palavras-chave, abstract e keywords, texto,&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>figuras, tabelas, mapas, referencias e legendas. &nbsp; &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Nenhum arquivo poder&aacute; ultrapassar a 10Mb de tamanho. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Forma de envio: O &nbsp;texto dever&aacute; ser enviado junto com as &nbsp;ilustra&ccedil;&otilde;es</big></span></span></span> <span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>(inclusive tabelas) nno Sistema Eletr&ocirc;nico de submiss&atilde;o (ver passos pr&aacute;ticos&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>para envio de manuscritos na p&aacute;gina da RBGEA, no &iacute;tem &quot;Instru&ccedil;&otilde;es para&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>envio de artigos&quot;).&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>&nbsp; &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><strong><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Artigos</big></span></span></span></strong></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Organiza&ccedil;&atilde;o de artigos: dever&aacute; constar em seq&uuml;&ecirc;ncia, o t&iacute;tulo, nome&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>completo do(s) autor(es), institui&ccedil;&atilde;o e e-mail (nome da institui&ccedil;&atilde;o, cidade,&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>estado, pa&iacute;s e e-mail. Para &nbsp;alunos de mestrado ou doutorado, indicar&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>&quot;Programa de P&oacute;s-gradua&ccedil;&atilde;o&quot;, institui&ccedil;&atilde;o, e demais informa&ccedil;&otilde;es acima),&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>resumo e palavras-chave, abstract e keywords, texto completo, refer&ecirc;ncias, ilustra&ccedil;&otilde;es e tabelas. O texto deve conter, preferencialmente: introdu&ccedil;&atilde;o,&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>materiais e m&eacute;todos, resultados, discuss&atilde;o, conclus&otilde;es e agradecimentos.&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Hierarquiza&ccedil;&atilde;o dos t&iacute;tulos e subt&iacute;tulos: Deve seguir o padr&atilde;o: </big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>N&iacute;vel 1 &ndash; EM NEGRITO, TODAS AS LETRAS MAI&Uacute;SCULAS. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>N&iacute;vel 2 &ndash; Em negrito; a primeira letra da primeira palavra em mai&uacute;scula e as&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>demais min&uacute;sculas. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>N&iacute;vel 3 - &nbsp;IT&Aacute;LICO, N&Atilde;O NEGRITO, TODAS AS LETRAS&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>MAI&Uacute;SCULAS. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>N&iacute;vel 4 &ndash; &nbsp;It&aacute;lico, n&atilde;o negrito; a primeira letra da primeira palavra em&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>mai&uacute;scula e as demais min&uacute;sculas. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Agradecimentos &ndash; &nbsp;Negrito e it&aacute;lico (apenas o subt&iacute;tulo). &nbsp;Refer&ecirc;ncias &ndash;&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Negritas e min&uacute;sculas (apenas o subt&iacute;tulo). &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Manter um espa&ccedil;o simples entre itens e subitens do texto. Utilizar fonte&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Times New Roman, tamanho 11.&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>A indica&ccedil;&atilde;o da inser&ccedil;&atilde;o das ilustra&ccedil;&otilde;es (figuras, tabelas, etc) no texto dever&aacute; ser em&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>posi&ccedil;&atilde;o o mais pr&oacute;ximo poss&iacute;vel de sua primeira cita&ccedil;&atilde;o. </big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Formato do Resumo, Resumen e o Abstract: N&atilde;o poder&atilde;o exceder 300&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>palavras cada, em par&aacute;grafo &uacute;nico, fonte Times New Roman, corpo 10,&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>espa&ccedil;o simples (1,0) e serem seguidos de palavras-chaves, palabras claves e&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>keywords (no m&iacute;nimo 3 e m&aacute;ximo 5), respectivamente. Artigos em&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>portugu&ecirc;s, espanhol ou franc&ecirc;s dever&atilde;o ter o t&iacute;tulo vertido para o idioma&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>ingl&ecirc;s, em MAI&Uacute;SCULO E IT&Aacute;LICO, colocado ap&oacute;s a palavra Abstract. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Formato do texto: Editar o texto em Word, fonte Times New Roman, corpo&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>11, espa&ccedil;o simples, papel A4, orienta&ccedil;&atilde;o em retrato e editado em apenas&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>uma coluna. As margens dever&atilde;o ter as seguintes medidas: superior: 2,0;&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>inferior 2,0; esquerda 3,0 e direita &nbsp;2,0. Digitar as tabelas em documentos&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>word. Abrevia&ccedil;&otilde;es: Devem ser evitadas ou mantidas ao m&iacute;nimo. Se usadas, devem&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>ser definidas na primeira vez que &nbsp;forem mencionadas e n&atilde;o devem ser&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>utilizadas no t&iacute;tulo, resumo e abstract.&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Ilustra&ccedil;&otilde;es: A vers&atilde;o impressa da RBG &nbsp;publica ilustra&ccedil;&otilde;es em preto e&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>branco e tons de cinza. A vers&atilde;o &ldquo;on line&rdquo; publica&ccedil;&otilde;es coloridas. As fontes&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>usadas para textos sobre fotografias deve ser uma da fam&iacute;lia da Helv&eacute;tica. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>As ilustra&ccedil;&otilde;es gr&aacute;ficas, fotogr&aacute;ficas e fotomicrogr&aacute;ficas ser&atilde;o numeradas&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>seq&uuml;encialmente, na ordem de sua cita&ccedil;&atilde;o no texto e consideradas, mesmo pranchas,&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>indiscriminadamente como Figuras. Dever&atilde;o ser separadas do texto por uma linha.&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>N&atilde;o ser&atilde;o aceitos encartes. Fotografias de afloramentos dever&atilde;o apresentar barra de&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>escala e indica&ccedil;&atilde;o do norte.&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Letreiros e s&iacute;mbolos das ilustra&ccedil;&otilde;es devem ter dimens&otilde;es adequadas para permitir&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>legibilidade. As ilustra&ccedil;&otilde;es dever&atilde;o ter larguras &nbsp;m&iacute;nimas de 9 ou 18 cent&iacute;metros&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>(permitir diagrama&ccedil;&atilde;o em uma ou duas colunas). Explicar todos os s&iacute;mbolos.&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Escalas gr&aacute;ficas, se necess&aacute;rias, devem ser colocadas dentro da &aacute;rea das ilustra&ccedil;&otilde;es.&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>As &nbsp;Tabelas devem ser auto-explicativas, com as laterais abertas, concisas e&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>numeradas seq&uuml;encialmente. Devem ser elaboradas em Times New Roman, corpo 9.&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>As legendas das ilustra&ccedil;&otilde;es dever&atilde;o ser redigidas com a mesma fonte do texto e&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>corpo.&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Formato das Figuras: S&oacute; ser&atilde;o aceitas figuras &nbsp;.tif, devendo ter resolu&ccedil;&atilde;o m&iacute;nima&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>de 300dpi, com tamanhos largura de 8,7 cm ou de 17,7, com comprimento m&aacute;ximo&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>de 21 cm.&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>F&oacute;rmulas e Equa&ccedil;&otilde;es: Numerar as f&oacute;rmulas e equa&ccedil;&otilde;es seq&uuml;encialmente &agrave;&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>direita, com n&uacute;meros ar&aacute;bicos entre par&ecirc;nteses e, no texto, referir como&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>&ldquo;equa&ccedil;&atilde;o (1)&rdquo;, etc. &nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Cita&ccedil;&otilde;es no corpo do texto: &nbsp;Deve-se seguir os formatos do seguinte&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>exemplo: ...&quot;Cunha (1985) interpreta a fei&ccedil;&atilde;o como uma estrutura de&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>resfriamento magm&aacute;tico</big></span></span></span> <span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>precoce, mas outros (Lima 1986, Fonseca &nbsp;et al.&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>1989, Ferreira &amp; Ara&uacute;jo 1994) como uma fei&ccedil;&atilde;o tardia&quot;. Refer&ecirc;ncias: Relat&oacute;rios internos s&atilde;o ser&atilde;o aceitos nas refer&ecirc;ncias, com&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>excess&atilde;o daqueles que s&atilde;o amplamente difundidos na comunidade cientifica&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>e autorizados pelos consultores ad hoc. As refer&ecirc;ncias dever&atilde;o ser feitas em&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Times New Roman, corpo 10. Ao final do texto, ordenar as refer&ecirc;ncias em&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>ordem alfab&eacute;tica do sobrenome do primeiro autor, empregando os seguintes&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>formatos:&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><strong><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Livros</big></span></span></span></strong></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Arndt N.T. &amp; Nisbet E.G. (Eds.) 1982. Komatiites. George Allen &amp; Unwin, London,&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>526 pp. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Cap&iacute;tulos de Livros: &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Pollack H.N. 1997. Thermal characteristics of the Archean. In: M. de Wit &amp; L.D.&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Ashwal (eds.) Greenstone belts. Oxford Monographs on Geology and Geophysics,&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>25, Oxford University Press, p.: 223-232.&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Artigos de Peri&oacute;dicos:</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Resende M.G. &amp; Jost H. 1995. Petrog&ecirc;nese de forma&ccedil;&otilde;es ferr&iacute;feras e&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>metahidrotermalitos da Forma&ccedil;&atilde;o Aimb&eacute;, Grupo Guarinos (Arqueano), Goi&aacute;s.&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Rev.Bras. Geoc., 25:41-50.&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Resende M.G., Jost H., Osborne G.A., Mol A. 1998. The stratigraphy of the Goi&aacute;s&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>and Faina greenstone belts, Central Brazil: a new proposal. Rev. Bras. Geoc., 28:1-</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>15.&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Sab&oacute;ia L. A. 1979. Os greenstone belts de Crix&aacute;s e Goi&aacute;s, Go. In: SBG, N&uacute;cleo&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Centro-Oeste, Boletim Informativo, 9:44-72.&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Artigos em Publica&ccedil;&otilde;es Seriadas:&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Barbosa O., Braun O.P.G., Dyer R.C., Cunha C.A.B.R. 1970. Geologia da regi&atilde;o&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>do Tri&acirc;ngulo Mineiro. Rio de Janeiro, DNPM/DFPM, Boletim 136, 140 p. &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Teses e Disserta&ccedil;&otilde;es:&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Resende L. 1995. Estratigrafia, petrografia e geoqu&iacute;mica da seq&uuml;&ecirc;ncia sedimentar&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>do greenstone Belt de Pilar de Goi&aacute;s, GO. Disserta&ccedil;&atilde;o de Mestrado, Instituto de&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Geoci&ecirc;ncias, Universidade de Bras&iacute;lia, 124 p. &nbsp; </big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Artigos publicados em eventos: &nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Tassinari C.C.G., Siga Jr. O, Teixeira W. 1981. P