 da terra. SF-23-Y-D-II-1 MI-2769/1. S&atilde;o Jos&eacute; dos Campos,&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Mapa Topogr&aacute;fico, escala 1:100.000.&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Silva A.J. 1999. Mapa geol&oacute;gico da Bacia de Campos. Rio de Janeiro, Petrobr&aacute;s, 1&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>mapa geol&oacute;gico, escala 1:50.000.&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Programas e conjuntos de softwares:&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>MICROSOFT 1995. Project for Windows &nbsp;95, version 4.1: &nbsp;project planning&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>software. Redmond, Wa, Microsoft Corporation. Conjunto de programas 1 CDROM.&nbsp;</big></span></span></span><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>P&aacute;ginas e documentos consultados via internet: Moura G.A.C. de M. 1996. Cita&ccedil;&atilde;o de referencias e documentos eletr&ocirc;nicos.&nbsp;</big></span></span></span></div>\r\n<div style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Dispon&iacute;vel em: http://www.elogica.