	('Objetivos', '<div style="text-align: justify;">Por meio desta base de dados o visitante poder&aacute; identificar os trabalhos de cartografia j&aacute; realizados no Brasil, seus autores, ano de publica&ccedil;&atilde;o, &aacute;reas mapeadas (regi&atilde;o ou munic&iacute;pio), mapas gerados, escala de trabalho e resumo do trabalho.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;">Al&eacute;m do registro da produ&ccedil;&atilde;o cartogr&aacute;fica, a base de dados fornece tamb&eacute;m informa&ccedil;&otilde;es sobre as institui&ccedil;&otilde;es que desenvolveram os trabalhos de cartografia e os profissionais que atuam na &aacute;rea. Espera-se que esta base de dados seja uma refer&ecirc;ncia n&atilde;o s&oacute; na pesquisa de trabalhos e m&eacute;todos desenvolvidos, mas tamb&eacute;m ser uma fonte de contato entre as institui&ccedil;&otilde;es e profissionais que produzem cartografia geot&eacute;cnica e geoambiental no Brasil.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;">A vers&atilde;o preliminar do Banco de Dados sobre Cartografia Geot&eacute;cnica e Geoambiental do Brasil foi apresentada no 12&ordm; Congresso Brasileiro de Geologia de Engenharia e Ambiental, quando a Comiss&atilde;o se reuniu para delibera&ccedil;&atilde;o sobre as pr&oacute;ximas atividades a serem desenvolvidas. A base do banco foi alimentada e seu lan&ccedil;amento oficial ocorreu no in&iacute;cio de 2009.</div>\r\n<div>&nbsp;</div>\r\n<p><!--[if gte mso 9]><xml>\r\n<o:OfficeDocumentSettings>\r\n<o:AllowPNG />\r\n</o:OfficeDocumentSettings>\r\n</xml><![endif]--></p>\r\n<p><!--[if gte mso 9]><xml>\r\n<w:WordDocument>\r\n<w:View>Normal</w:View>\r\n<w:Zoom>0</w:Zoom>\r\n<w:TrackMoves />\r\n<w:TrackFormatting />\r\n<w:HyphenationZone>21</w:HyphenationZone>\r\n<w:PunctuationKerning />\r\n<w:ValidateAgainstSchemas />\r\n<w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n<w:IgnoreMixedContent>false</w