>A participa&ccedil;&atilde;o nas atividades em desenvolvimento &eacute; livre para todos interessados.</p>\r\n</p>', '', '', '', 133, 'pt'),
	('Histórico', '<p>&nbsp;Ap&oacute;s sua formaliza&ccedil;&atilde;o, a Comiss&atilde;o de Cartografia Geot&eacute;cnica e Geoambiental da ABGE come&ccedil;ou elaborar um levantamento de dados e cadastro de institui&ccedil;&otilde;es, profissionais e trabalhos relacionado &agrave; Cartografia Geot&eacute;cnica e Geoambiental do Brasil. Para o registro dos dados, foram elaboradas planilhas cadastrais para institui&ccedil;&otilde;es, profissionais e para os trabalhos desenvolvidos. Os dados foram tabulados e uma an&aacute;lise preliminar foi feita obtendo-se um panorama da produ&ccedil;&atilde;o brasileira em cartografia geot&eacute;cnica e geoambiental. Estes resultados foram apresentados no 5&ordm; Simp&oacute;sio Brasileiro de Cartografia Geot&eacute;cnica e Geoambiental, realizado em 2004, <st1:personname productid="em S?o Carlos" w:st="on">em S&atilde;o Carlos</st1:personname> (SP). Ap&oacute;s o evento, o N&uacute;cleo Minas Gerais da ABGE assumiu a montagem e organiza&ccedil;&atilde;o de um banco de dados a partir do cadastro existente. Os resultados preliminares desta etapa foram discutidos durante o XI Congresso Brasileiro de Geologia de Engenharia e Ambiental, realizado em Florian&oacute;polis no ano de 2005. O Banco de Dados sobre a Cartografia Geot&eacute;cnica e Geoambiental do Brasil ser&aacute; uma base de dados de toda produ&ccedil;&atilde;o brasileira em cartografia geot&eacute;cnica e geoambiental desenvolvida em universidades, institutos de pesquisa, &oacute;rg&atilde;os p&uacute;blicos e pelo setor privado no Brasil.</p>\r\n<p class="MsoNormal"><span lang="PT-BR">Est&atilde;o lan&ccedil;ados no banco todos os trabalhos publicados nos Simp&oacute;sios Brasileiros, Congressos Brasileiros de Geololgia de Engenharia, Revista Solos e Rochas, Revista Geotecnia e alguns de outros eventos. Faltam ainda trabalhos de p&oacute;s-gradua&ccedil;&atilde;o, inicia&ccedil;&atilde;o cient&iacute;fica, relat&oacute;rios t&eacute;cnicos e trabalhos publicados em outros eventos e peri&oacute;dicos que n&atilde;o puderam ser levantados at&eacute; o momento. O Banco de Dados ter&aacute; a alimenta&ccedil;&atilde;o feita pelos pr&oacute;prios autores, que dever&atilde;o se cadastrar no mesmo e lan&ccedil;ar seus trabalhos. O procedimento para esta tarefa constar&atilde;o no pr&oacute;prio Banco de Dados e seguir&aacute; as normas bibliogr&aacute;ficas da ABNT, com outras informa&ccedil;&otilde;es tais como Institui&ccedil;&atilde;o, local do trabalho, escala e resumo. Assim, solicitamos o empenho de todos no lan&ccedil;amento das informa&ccedil;&otilde;es de forma a termos um banco de dados o mais completo poss&iacute;vel, assim como a divulga&ccedil;&atilde;o do mesmo, inclusive a outras entidades t&eacute;cnico-cient&iacute;ficas.&nbsp;<o:p></o:p></span></p>', '', '', '', 134, 'pt'),
	('Banco de Ensino ', '<p style="text-align: center;"><span style="color: rgb(128, 128, 128);"><strong>Banco de Dados com informa&ccedil;&otilde;es curriculares dos<br />\r\nCursos de Gradua&ccedil;&atilde;o em Geologia e Engenharia Geol&oacute;gica<br />\r\nde Universidades brasileiras<br />\r\n- 1&ordf; vers&atilde;o, dados de 2012/2013 -</strong><br />\r\n</span></p>\r\n<p style="text-align: left;"><span style="color: rgb(128, 128, 128);"><br />\r\n<br />\r\n<strong>APRESENTA&Ccedil;&Atilde;O</strong><br />\r\n</span></p>\r\n<p style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><br />\r\nA ABGE (Associa&ccedil;&atilde;o Brasileira de Geologia de Engenharia e Ambiental), por meio de sua Diretoria Especial de Ensino e Apoio ao Jovem Profissional, estruturou um Banco de Dados contendo informa&ccedil;&otilde;es curriculares dos Cursos de Gradua&ccedil;&atilde;o em Geologia e Engenharia Geol&oacute;gica das Universidades Brasileiras.<br />\r\nPara a estrutura&ccedil;&atilde;o do Banco de Dados foi realizado, ao longo do ano de 2012 e no in&iacute;cio de 2013, um amplo levantamento para obten&ccedil;&atilde;o de informa&ccedil;&otilde;es curriculares dos Cursos de Gradua&ccedil;&atilde;o em Geologia e Engenharia Geol&oacute;gica das Universidades Brasileiras, consultando diretamente as Institui&ccedil;&otilde;es de Ensino, especialmente os coordenadores dos cursos. O levantamento n&atilde;o contemplou cursos de gradua&ccedil;&atilde;o em engenharia de minas, civil e ambiental, tampouco os programas de p&oacute;s-gradua&ccedil;&atilde;o em Geotecnia.<br />\r\nAs informa&ccedil;&otilde;es curriculares enviadas pelas Universidades n&atilde;o passaram por qualquer tipo de tratamento, somente sendo classificadas quanto ao seu conte&uacute;do, para facilitar a estrutura&ccedil;&atilde;o do Banco de Dados. Os documentos enviados pelas Institui&ccedil;&otilde;es de Ensino que n&atilde;o continham as grades curriculares dos cursos n&atilde;o foram selecionados para fazer parte do Banco de Dados, sendo substitu&iacute;dos por informa&ccedil;&otilde;es obtidas no in&iacute;cio de 2013 nas p&aacute;ginas das Universidades na Internet, quando dispon&iacute;veis. Informa&ccedil;&otilde;es das Institui&ccedil;&otilde;es de Ensino que n&atilde;o enviaram dados tamb&eacute;m foram obtidas na Internet.<br />\r\nA consulta ao Banco de Dados permite verificar a situa&ccedil;&atilde;o atual do ensino de Geologia no Brasil, bem como proporciona uma vis&atilde;o abrangente das estruturas curriculares e demais aspectos dos Cursos de Gradua&ccedil;&atilde;o em Geologia ou Engenharia Geol&oacute;gica no Brasil. Particularmente quanto ao ensino de Geologia de Engenharia e de Geologia Ambiental, o Banco de Dados re&uacute;ne informa&ccedil;&otilde;es que permitem a verifica&ccedil;&atilde;o da situa&ccedil;&atilde;o atual, visando estimular reflex&otilde;es e debates sobre a constante atualiza&ccedil;&atilde;o e moderniza&ccedil;&atilde;o do processo ensino-aprendizado.<br />\r\nAs informa&ccedil;&otilde;es disponibilizadas no Banco de Dados t&ecirc;m import&acirc;ncia especial, sobretudo no momento em que muitos cursos est&atilde;o em meio a discuss&otilde;es sobre reforma curricular, enquanto outros est&atilde;o em meio a processos de moderniza&ccedil;&atilde;o dos projetos pedag&oacute;gicos.<br />\r\n</span></p>\r\n<p style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><br />\r\nPretende-se proceder a complementa&ccedil;&otilde;es, corre&ccedil;&otilde;es e atualiza&ccedil;&otilde;es no Banco de Dados, seja a partir de novas consultas &agrave;s Institui&ccedil;&otilde;es de Ensino ou pelo envio espont&acirc;neo de novas informa&ccedil;&otilde;es por parte de docentes das Universidades ou de colaboradores. Os coordenadores de curso e demais docentes que desejarem incluir ou substituir informa&ccedil;&otilde;es curriculares disponibilizadas no Banco de Dados devem enviar os arquivos digitais para o e-mail lescerri@rc.unesp.br.<br />\r\n</span></p>\r\n<p style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><br />\r\nA Diretoria Especial de Ensino e Apoio ao Jovem Profissional da ABGE agradece aos coordenadores dos Cursos de Gradua&ccedil;&atilde;o em Geologia ou Engenharia Geol&oacute;gica pelo envio das informa&ccedil;&otilde;es curriculares solicitadas. Registra especial agradecimento &agrave; secret&aacute;ria do Depto de Geologia Aplica, IGCE/Unesp de Rio Claro (SP), M&aacute;rcia Regina Tavolari do Amaral, pelos contatos com as Institui&ccedil;&otilde;es de Ensino e obten&ccedil;&atilde;o dos e-mails dos coordenadores dos cursos, bem como &agrave; graduanda em Engenharia Ambiental da Unesp de Rio Claro (SP), Ana Paula Bortolucci, pelo aux&iacute;lio na tarefa de coleta e organiza&ccedil;&atilde;o dos dados.<br />\r\n<br />\r\n<strong>PRIMEIROS RESULTADOS OBTIDOS A PARTIR DA AN&Aacute;LISE DAS INFORMA&Ccedil;&Otilde;ES CONTIDAS NO BANCO DE DADOS</strong><br />\r\n</span></p>\r\n<p style="text-align: center;"><span style="color: rgb(128, 128, 128);"><strong><img width="400" height="424" alt="" src="/uploads/imgfck/image/LocalizacaoCursos_Geol_ABGE.jpg" /></strong></span></p>\r\n<p style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><br />\r\nA partir do desenvolvimento das atividades para a elabora&ccedil;&atilde;o do Banco de Dados com informa&ccedil;&otilde;es curriculares dos Cursos de Gradua&ccedil;&atilde;o em Geologia e Engenharia Geol&oacute;gica das Universidades Brasileiras, foram obtidas interessantes conclus&otilde;es, apresentadas a seguir:<br />\r\n1)&nbsp;&nbsp;&nbsp; 31 universidades brasileiras oferecem Cursos de Gradua&ccedil;&atilde;o em Geologia ou Engenharia Geol&oacute;gica (dados de 2012);<br />\r\n2)&nbsp;&nbsp;&nbsp; os cursos localizam-se em 16 estados e tamb&eacute;m no Distrito Federal, compreendendo todas as regi&otilde;es brasileiras (Figura 1);<br />\r\n3)&nbsp;&nbsp;&nbsp; 29 destes cursos possuem a denomina&ccedil;&atilde;o &ldquo;Curso de Gradua&ccedil;&atilde;o em Geologia&rdquo;, enquanto 02 t&ecirc;m a denomina&ccedil;&atilde;o &ldquo;Curso de Gradua&ccedil;&atilde;o em Engenharia Geol&oacute;gica&rdquo; (UFOP &ndash; Univ. Federal de Ouro Preto, MG e UFPel - Univ. Federal de Pelotas, RS);<br />\r\n4)&nbsp;&nbsp;&nbsp; dentre as 31 universidades que oferecem Cursos de Gradua&ccedil;&atilde;o em Geologia ou Engenharia Geol&oacute;gica, 27 s&atilde;o p&uacute;blicas, das quais 23 na esfera federal e 04 em &acirc;mbito estadual (USP, Unicamp e Unesp no Est. de S&atilde;o Paulo e UERJ, no Est. do Rio de Janeiro);<br />\r\n5)&nbsp;&nbsp;&nbsp; 04 Institui&ccedil;&otilde;es de Ensino s&atilde;o particulares (Unisinos, em S&atilde;o Leopoldo, RS; Unimonte, em Santos, SP; FINOM, em Paracatu, MG e UVV, em Vila Velha, ES), com valores das mensalidades em torno de R$ 1.000,00 referentes ao 1&ordm; semestre de 2013; e<br />\r\n6)&nbsp;&nbsp;&nbsp; h&aacute; 02 cursos de gradua&ccedil;&atilde;o oferecidos no per&iacute;odo noturno (Unimonte, em Santos, SP e FINOM, em Paracatu, MG).<br />\r\n<br />\r\nNa Tabela 1 (<a href="/uploads/imgfck/file/Tabela_1_Banco_Dados_ABGE.pdf">Clique aqui e veja os dados</a>) est&atilde;o relacionadas as 31 Universidades brasileiras que oferecem Cursos de Gradua&ccedil;&atilde;o em Geologia ou Engenharia Geol&oacute;gica, inclusive com os endere&ccedil;os das Institui&ccedil;&otilde;es de Ensino na Internet e e-mails para contato.<br />\r\nO Banco de Dados apresenta informa&ccedil;&otilde;es curriculares de 30 Universidades brasileiras que oferecem Cursos de Gradua&ccedil;&atilde;o em Geologia e Engenharia Geol&oacute;gica (faltando apenas informa&ccedil;&otilde;es sobre a UFOPA), sendo 14 Projetos Pedag&oacute;gicos (12 dos quais enviados pelas Institui&ccedil;&otilde;es de Ensino) e 16 Grades Curriculares (13 das quais obtidas na Internet). </span></p>\r\n<p style="text-align: justify;"><span style="color: rgb(128, 128, 128);">Os arquivos digitais com as informa&ccedil;&otilde;es curriculares dos Cursos de Gradua&ccedil;&atilde;o em Geologia e Engenharia Geol&oacute;gica das Universidades Brasileiras podem ser acessados clicando <a href="http://www.abge.org.br/index.php/abge/grade-escolas">aqui</a>!<br />\r\n<br />\r\n<strong>ASPECTOS RELACIONADOS &Agrave;S DISCIPLINAS GEOLOGIA DE ENGENHARIA E GEOLOGIA AMBIENTAL</strong><br />\r\n</span></p>\r\n<p style="text-align: justify;"><span style="color: rgb(128, 128, 128);"><br />\r\n&nbsp;&nbsp;&nbsp; As informa&ccedil;&otilde;es curriculares reunidas possibilitaram a an&aacute;lise de aspectos referentes ao ensino de Geologia de Engenharia e de Geologia Ambiental em 30 Universidades brasileiras que oferecem o Curso de Gradua&ccedil;&atilde;o em Geologia e Engenharia Geol&oacute;gica, cujos resultados s&atilde;o apresentados na Tabela 3 (<a href="/uploads/imgfck/file/Tabela_3_Disciplinas_ABGE.pdf">Clique aqui </a>e veja os dados).<br />\r\n&nbsp;&nbsp;&nbsp; Em rela&ccedil;&atilde;o ao ensino de Geologia de Engenharia, das 30 Universidades analisadas, 25 oferecem a disciplina Geologia de Engenharia como disciplina obrigat&oacute;ria. Nesta an&aacute;lise foram consideradas as disciplinas denominadas Geologia de Engenharia, Geot&eacute;cnica, Geot&eacute;cnica e Sondagens, Geotecnia, Geologia Aplicada &agrave; Engenharia e Geotecnologia, admitindo-se que o conte&uacute;do program&aacute;tico das disciplinas com as denomina&ccedil;&otilde;es citadas englobam temas da Geologia de Engenharia.<br />\r\n&nbsp;&nbsp;&nbsp; A carga hor&aacute;ria da disciplina obrigat&oacute;ria Geologia de Engenharia varia de 40h (UVV), at&eacute; 120h (Unesp), sendo oferecida desde o 5&ordm; per&iacute;odo (UFSC) at&eacute; o 9&ordm; per&iacute;odo do curso (Unisinos, Unipampa, Unicamp, Unesp, FINOM), com franco predom&iacute;nio de oferecimento na segunda metade do curso.<br />\r\n&nbsp;&nbsp;&nbsp; <br />\r\n</span></p>\r\n<p style="text-align: justify;"><span style="color: rgb(128, 128, 128);">Outras 4 Universidades (UnB, UFBA Barreira, UFBA Salvador e UFRN) n&atilde;o oferecem a disciplina Geologia de Engenharia com car&aacute;ter obrigat&oacute;rio, mas oferecem disciplinas optativas equivalentes, denominadas de Geologia de Engenharia, Geotecnia Ambiental e Geologia Aplicada &agrave; Engenharia.<br />\r\n&nbsp;Apenas a Unimonte n&atilde;o contempla a disciplina Geologia de Engenharia na grade curricular de seu curso, seja como obrigat&oacute;ria ou optativa.<br />\r\n&nbsp;&nbsp; Em rela&ccedil;&atilde;o ao ensino de Geologia Ambiental, das 30 Universidades analisadas, 21 oferecem a disciplina Geologia Ambiental com car&aacute;ter obrigat&oacute;rio, tendo sido consideradas as disciplinas denominadas Geologia Ambiental, Geologia e Meio Ambiente, Geologia Ambiental e do Quatern&aacute;rio e Introdu&ccedil;&atilde;o &agrave; Geologia Ambiental, admitindo-se que o conte&uacute;do program&aacute;tico destas disciplinas englobam temas da Geologia Ambiental.<br />\r\n&nbsp;&nbsp;&nbsp; <br />\r\n</span></p>\r\n<p style="text-align: justify;"><span style="color: rgb(128, 128, 128);">A carga hor&aacute;ria da disciplina obrigat&oacute;ria Geologia Ambiental varia de 40h (UVV) e 45h (UFRJ), at&eacute; o m&aacute;ximo de 85h (UFBA Salvador), sendo que na ampla maioria das Universidades consideradas a carga hor&aacute;ria &eacute; de 60h.<br />\r\nA disciplina obrigat&oacute;ria Geologia Ambiental &eacute; oferecida desde o 3&ordm; per&iacute;odo (UFC) at&eacute; o 9&ordm; per&iacute;odo do curso (Unisinos, Unesp, UFRRJ, UFOP e UFAM), tamb&eacute;m apresentando predom&iacute;nio de oferecimento na segunda metade do curso.<br />\r\n&nbsp;&nbsp;&nbsp; <br />\r\n</span></p>\r\n<p style="text-align: justify;"><span style="color: rgb(128, 128, 128);">Outras 5 Universidades (USP, FINOM, UnB, UFPA Bel&eacute;m e UFPA Marab&aacute;) oferecem apenas disciplinas optativas, denominadas Geologia Ambiental ou Geologia e Geoqu&iacute;mica Ambiental.<br />\r\n&nbsp;&nbsp;&nbsp;<br />\r\n</span></p>\r\n<p style="text-align: justify;"><span style="color: rgb(128, 128, 128);"> H&aacute; ainda 2 Universidades que n&atilde;o oferecem a disciplina Geologia Ambiental como obrigat&oacute;ria ou optativa, mas oferecem disciplinas correlatas, como Recupera&ccedil;&atilde;o de &Aacute;reas Degradadas (obrigat&oacute;ria, UFPel) e Geologia Urbana (obrigat&oacute;ria) e Minera&ccedil;&atilde;o e Meio Ambiente (optativa), ambas na Unicamp.<br />\r\nA disciplina Geologia Ambiental n&atilde;o consta como obrigat&oacute;ria nem optativa na grade curricular dos cursos da Unimonte e UFMT.<br />\r\n</span></p>\r\n<p style="text-align: right;"><span style="color: rgb(128, 128, 128);"><br />\r\nS&atilde;o Paulo, maio de 2013<br />\r\n<strong>Diretoria Especial de Ensino e Apoio ao Jovem Profissional</strong></span></p>', '', '', '', 143, 'pt'),
	('Volume 2, nº 2, 2012', '<p>&nbsp;</p>\r\n<div><strong><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Revista Brasileira de Geologia de Engenharia e Ambiental (RBGEA) </big></span></span></span></strong></div>\r\n<div>&nbsp;<br />\r\n<span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><em>Volume 2, n&ordm; 2, 2012</em></big></span></span></span></big></span></span></span></div>\r\n<div>&nbsp;</div>\r\n<div><!--[if gte mso 9]><xml>\r\n<o:OfficeDocumentSettings>\r\n<o:AllowPNG />\r\n</o:OfficeDocumentSettings>\r\n</xml><![endif]--><span style="color: rgb(128, 128, 128);"><span style="font-size: 11pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;">ISSN 2317-370X </span></span><!--[if gte mso 9]><xml>\r\n<w:WordDocument>\r\n<w:View>Normal</w:View>\r\n<w:Zoom>0</w:Zoom>\r\n<w:TrackMoves />\r\n<w:TrackFormatting />\r\n<w:HyphenationZone>21</w:HyphenationZone>\r\n<w:PunctuationKerning />\r\n<w:ValidateAgainstSchemas />\r\n<w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n<w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n<w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n<w:DoNotPromoteQF />\r\n<w:LidThemeOther>PT-BR</w:LidThemeOther>\r\n<w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n<w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n<w:Compatibility>\r\n<w:BreakWrappedTables />\r\n<w:SnapToGridInCell />\r\n<w:WrapTextWithPunct />\r\n<w:UseAsianBreakRules />\r\n<w:DontGrowAutofit />\r\n<w:SplitPgBreakAndParaMark />\r\n<w:EnableOpenTypeKerning />\r\n<w:DontFlipMirrorIndents />\r\n<w:OverrideTableStyleHps />\r\n</w:Compatibility>\r\n<w:DoNotOptimizeForBrowser />\r\n<m:mathPr>\r\n<m:mathFont m:val="Cambria Math" />\r\n<m:brkBin m:val="before" />\r\n<m:brkBinSub m:val="&#45;-" />\r\n<m:smallF