	('Palestras 14º CBGE', '<p>Confira as palestras das mesas redondas que aconteceram durante o 14&ordm; Congresso Brasileiro de Geologia de Engenharia, realizado entre os dias 02 e 06 de dezembro de 2013:</p>\r\n<p>&nbsp;</p>\r\n<p><u>02 de dezembro de 2013</u></p>\r\n<p><strong>MR1: Produ&ccedil;&atilde;o e uso de cartografia geot&eacute;cnica e geoambiental no planejamento urbano e regional.</strong></p>\r\n<p><u><em>Moderador</em></u><em>: Marcos Musso (Universidad de La Republica Oriental del Uruguay)</em></p>\r\n<p><em>Debatedores</em></p>\r\n<p><a href="http://abge1.hospedagemdesites.ws/uploads/imgfck/file/Marcelo_Dantas02-12.pdf"><strong>1. O Mapeamento da geodiversidade e sua import&acirc;ncia para o planejamento territorial: a experi&ecirc;ncia da CPRM - Servi&ccedil;o Geol&oacute;gico do Brasil</strong></a></p>\r\n<p><em>Marcelo Eduardo Dantas (CPRM)</em></p>\r\n<p><a href="http://abge1.hospedagemdesites.ws/uploads/imgfck/file/Alvaro_Rodrigues02-12.pdf"><strong>2. Carta Geot&eacute;cnica: quest&otilde;es conceituais e metodol&oacute;gicas fundamentais</strong></a></p>\r\n<p><em>&Aacute;lvaro Rodrigues dos Santos (ARS Geologia)</em></p>\r\n<p><a href="http://abge1.hospedagemdesites.ws/uploads/imgfck/file/Martin_Culshaw_02-12%20sl01.pdf"><strong>Confer&ecirc;ncia 1 - Cartografia Geot&eacute;cnica e Geoambiental: Estado da Arte</strong></a></p>\r\n<p><em><u>Presidente:<strong> </strong></u>Francisco Nogueira de Jorge (ENGEO Consultoria e Projetos)</em></p>\r\n<p><u><em>Conferencista</em></u>: <em>Martin Culshaw (British Geological Survey)</em></p>\r\n<p>&nbsp;</p>\r\n<p><u>03 de dezembro de 2013</u></p>\r\n<p><strong>MR 2: Atua&ccedil;&atilde;o de entidades p&uacute;blicas, privadas e de ensino e pesquisa na cartografia geot&eacute;cnica e geoambiental</strong></p>\r\n<p><u><em>Moderador</em></u><em>: Jos&eacute; Augusto de Lollo (UNESP)<br />\r\n</em></p>\r\n<p><em>Debatedores</em></p>\r\n<p><a href="http://abge1.hospedagemdesites.ws/uploads/imgfck/file/Antonio_Theodorovicz_03-12.pdf"><strong>1. Atua&ccedil;&atilde;o da CPRM/SGB na gera&ccedil;&atilde;o de informa&ccedil;&otilde;es geoambientais como subs&iacute;dio ao planejamento territorial e &agrave; gest&atilde;o ambiental</strong></a></p>\r\n<p>&nbsp;<em>Antonio Theodorovicz (CPRM)</em></p>\r\n<p><a href="http://abge1.hospedagemdesites.ws/uploads/imgfck/file/Alex_Lara_03-12.pdf"><strong>2. </strong><em>Alex Lara</em></a></p>\r\n<p>&nbsp;<strong>MR 5: Investiga&ccedil;&atilde;o e remedia&ccedil;&atilde;o de &aacute;reas contaminadas - estado da arte</strong></p>\r\n<p><em><u>Moderador: </u>Newton Miyashiro (Engesolos)</em></p>\r\n<p><em>Debatedores</em></p>\r\n<p><a href="http://abge1.hospedagemdesites.ws/uploads/imgfck/file/Everton_de_Oliveira03-12.pdf"><strong>1. Avaliar bem &eacute; sin&ocirc;nimo de economia de recursos</strong></a></p>\r\n<p><em>Everton de Oliveira ( Hidroplan/ABAS)</em></p>\r\n<p>&nbsp;</p>\r\n<p><strong>MR 3: Eros&atilde;o costeira e eros&atilde;o de margem de reservat&oacute;rio</strong></p>\r\n<p><em><u>Moderadora:</u></em> <em>Marta Pereira da Luz (Furnas)</em></p>\r\n<p><a href="http://abge1.hospedagemdesites.ws/uploads/imgfck/file/Adalberto_Azevedo03-12.pdf"><strong>1. Eros&atilde;o e margem e a jusante de reservat&oacute;rio</strong></a></p>\r\n<p><em>Adalberto A. Azevedo (IPT)</em></p>\r\n<p><strong>Mesa Redonda Especial:&nbsp;Gest&atilde;o de riscos e resposta a desastres<br />\r\n</strong></p>\r\n<p><em><u>Moderador</u></em><em>: Jo&atilde;o Jeronimo Monticeli</em> (<em>ABGE)</em></p>\r\n<p><a href="http://abge1.hospedagemdesites.ws/uploads/imgfck/file/Thales_de_Queiroz03-12.pdf"><strong>1. Mapeamento de suscetibilidade e riscos a movimentos de massa e inunda&ccedil;&otilde;es</strong></a></p>\r\n<p><em>Thales de Queiroz Sampaio (CPRM)</em></p>\r\n<p><strong><a href="http://abge1.hospedagemdesites.ws/uploads/imgfck/file/Regina_Alvala_03-12.pdf">2. Bases t&eacute;cnicas e crit&eacute;riosde monitoramento e alertas de risco de movimen