	('Volume 3, Número 1 - 2013', '<p>&nbsp;</p>\r\n<div><strong><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>Revista Brasileira de Geologia de Engenharia e Ambiental (RBGEA) </big></span></span></span></strong></div>\r\n<div>&nbsp;<br />\r\n<span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big><em>Volume 3, n&ordm; 1, 2013</em></big></span></span></span></big></span></span></span></div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: rgb(128, 128, 128);"><span style="font-size: 11pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;">ISSN 2317-370X </span></span></div>\r\n<div>&nbsp;</div>\r\n<div><a href="http://abge1.hospedagemdesites.ws/uploads/arquivos/archivoseccion_212_revistaabge_inicias.pdf "><span style="color: rgb(128, 128, 128);"><span style="font-size: 11pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;">EXPEDIENTE E APRESENTA&Ccedil;&Atilde;O</span></span></a></div>\r\n<p><span style="color: rgb(128, 128, 128);"><span style="font-size: smaller;"><span style="font-family: Verdana;"><big>&nbsp; <br />\r\nFA&Ccedil;A O DOWNLOAD DOS ARTIGOS:</big></span></span></span></p>\r\n<p>&nbsp;</p>\r\n<p><a href="http://www.abge.org.br/uploads/imgfck/file/Artigo_Estimativa_DaVulnerabilidae.pdf">ESTIMATIVA DA VULNERABILIDADE NATURAL DO AQU&Iacute;FERO LIVRE NO MUNIC&Iacute;PIO DE RIO CLARO/SP &nbsp;&nbsp; </a>&nbsp; <br />\r\nNat&aacute;lia Zanetti &nbsp;&nbsp; &nbsp;</p>\r\n<p><a href="http://www.abge.org.br/uploads/imgfck/file/Artigo_Comportamento_Geotecnico.pdf"><br />\r\nCOMPORTAMENTO GEOT&Eacute;CNICO E CLASSIFICA&Ccedil;&Atilde;O GEOMEC&Acirc;NICA DE MACI&Ccedil;OS ROCHOSOS EM TALUDES NA REGI&Atilde;O DE BELO HORIZONTE &nbsp;&nbsp; &nbsp; </a><br />\r\nC&aacute;ssio Ricardo de &Aacute;vila &nbsp;&nbsp; &nbsp; <br />\r\nMilene Sabino Lana &nbsp;&nbsp; &nbsp;</p>\r\n<p><br />\r\n<a href="http://www.abge.org.br/uploads/imgfck/file/Artigo_AvaliacaodeRisco.pdf">AVALIA&Ccedil;&Atilde;O DE RISCO GEOL&oacute;GICO EM BARRAGENS &nbsp;</a>&nbsp; &nbsp; <br />\r\nHenrieth Viviane Borgo de Oliveira &nbsp;&nbsp; &nbsp; <br />\r\nLuiz Ferreira Vaz &nbsp;&nbsp; &nbsp; <br />\r\nCelso Dal R&eacute; Carneiro &nbsp;&nbsp; &nbsp;</p>\r\n<p><a href="http://www.abge.org.br/uploads/imgfck/file/Artigo_EstudosobreRiscosGeo.pdf"><br />\r\nESTUDOS SOBRE RISCOS GEOL&Oacute;GICOS E SUA INCORPORA&Ccedil;&Atilde;O NO&nbsp; PLANEJAMENTO TERRITORIAL &ndash; RELATO DA EXPERI&Ecirc;NCIA DE FORMA&Ccedil;&Atilde;O DE QUADROS T&Eacute;CNICOS NO ABC PAULISTA &nbsp;&nbsp; &nbsp; </a><br />\r\nFernando Rocha Nogueira &nbsp;&nbsp; &nbsp; <br />\r\nRicardo de Sousa Moretti &nbsp;&nbsp; &nbsp; <br />\r\nCl&aacute;udia F. Escobar de Paiva &nbsp;&nbsp; &nbsp;</p>\r\n<p><br />\r\n<a href="http://www.abge.org.br/uploads/imgfck/file/Artigo_AImportanciadaGeologia.pdf">A IMPORT&Acirc;NCIA DA GEOLOGIA DE ENGENHARIA PARA O DIMENSIONAMENTO DOS PILARES NA CAMADA DE CARV&Atilde;O BONITO DA MINA FONTANELLA, TREVISO, SC &nbsp;&nbsp;</a> &nbsp; <br />\r\nClovis Gonzatti &nbsp;&nbsp; &nbsp; <br />\r\nRuy Paulo Philipp &nbsp;&nbsp; &nbsp; <br />\r\nAnt&ocirc;nio Pedro Viero &nbsp;&nbsp; &nbsp; <br />\r\nPaulo Cesar Vieira &nbsp;&nbsp; &nbsp; <br />\r\nS&iacute;lvio Fernando Ferreira &nbsp;&nbsp; &nbsp; <br />\r\nRodrigo Martins Saraiva &nbsp;&nbsp;</p>\r\n<p>&nbsp; <br />\r\n<a href="http://www.abge.org.br/uploads/imgfck/file/AGeoestatiscadaEspacializacao.pdf">A GEOESTAT&Iacute;STICA NA ESPACIALIZA&Ccedil;&Atilde;O DO COEFICIENTE DE PERMEABILIDADE EM SOLOS : experimenta&ccedil;&atilde;o de t&eacute;cnicas de krigagem e simula&ccedil;&atilde;o &nbsp;</a>&nbsp; &nbsp; <br />\r\nRafael Moniz Caixeta &nbsp;&nbsp; &nbsp; <br />\r\nRobson Teixeira Rollo &nbsp;&nbsp; &nbsp; <br />\r\nJos&eacute; Ricardo Sturaro &nbsp;&nbsp;&nbsp; <br />\r\n&nbsp;</p>\r\n<p><a href="http://www.abge.org.br/uploads/imgfck/file/Artigo_EstudoExperimentaldaTelagem.pdf">&nbsp;ESTUDO EXPERIMENTAL DA TELAGEM DE CHAPAS DE ROCHAS &ldquo;GRAN&Iacute;TICAS&rdquo; &nbsp; COM FIBRA DE SISAL &nbsp;&nbsp;</a>&nbsp; &nbsp;<br />\r\n&nbsp;Abiliane de Andrade Pazeto &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp;Antenor Braga Paraguass&uacute; &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n<p><a href="http://www.abge.org.br/uploads/imgfck/file/Artigo_ModeloConceitual.pdf">MODELO CONCEITUAL DA CONECTIVIDADE AQU&Iacute;FERO FRATURADO-AQUIFERO&nbsp; SEDIMENTAR EM AMBIENTE SUBTERR&Acirc;NEO CONSTRU&Iacute;DO</a> &nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>Malva Andrea Mancuso &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n<p><a href="http://www.abge.org.br/uploads/imgfck/file/Artigo_Modificacoes_Fluviais.pdf">MODIFICA&Ccedil;&Otilde;ES FLUVIAIS &Agrave; JUSANTE DE BARRAGENS &nbsp;&nbsp;&nbsp; &nbsp;</a><br />\r\nAlessandra Gon&ccedil;alves Siqueira &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\nAdalberto Aur&eacute;lio Azevedo &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\nLuiz Antonio Pereira de Souza &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\nMariucha da Silva &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n<p><br />\r\n<a href="http://www.abge.org.br/uploads/imgfck/file/Artigo_InvestigacaoGeoambiental.pdf">INVESTIGA&Ccedil;&Atilde;O GEOAMBIENTAL DE &Aacute;REAS CONTAMINADAS COM ELABORA&Ccedil;&Atilde;O DO MODELO CONCEITUAL EM CAMPO UTILIZANDO FERRAMENTAS DE ALTA &nbsp; RESOLU&Ccedil;&Atilde;O (HRSC) &nbsp;&nbsp;&nbsp;</a> &nbsp;<br />\r\n&nbsp;Marcos Tanaka Riyis &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp;Heraldo Luiz Giacheti &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp;Rafael Muraro Derrite &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp;Mauro Tanaka Riyis &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n<p><a href="http://www.abge.org.br/uploads/imgfck/file/Artigo_InfluenciadeDescontinuidades.pdf">INFLU&Ecirc;NCIA DE DESCONTINUIDADES GEOL&Oacute;GICAS NA ESTABILIDADE DE UMA&nbsp; ENCOSTA EM S&Atilde;O JOS&Eacute;-SC</a> &nbsp;&nbsp;&nbsp; <br />\r\n&nbsp;&nbsp;&nbsp; Marcelo Heidemann &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp;&nbsp;&nbsp; Luiz Ant&ocirc;nio Bressani &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp;&nbsp;&nbsp; Juan Altamirano Flores &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n<p><br />\r\n<a href="http://www.abge.org.br/uploads/imgfck/file/Artigo_EnsenarGeologiadeIngenieria.pdf">ENSE&Ntilde;AR GEOLOG&Iacute;A DE INGENIER&Iacute;A EN URUGUAY: desaf&iacute;os de nuevas metodolog&iacute;as &nbsp;&nbsp;&nbsp; </a>&nbsp;<br />\r\n&nbsp; Marcos Musso &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp;Ximena Otegui &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp;Carolina Fagundez &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n<p><a href="http://www.abge.org.br/uploads/imgfck/file/Artigo_MapeamentoGeologico-Geotecnico.pdf">&nbsp;MAPEAMENTO GEOL&Oacute;GICO-GEOT&Eacute;CNICO DA ESTRADA DE CASTELHANOS,&nbsp; ILHABELA (SP) </a>&nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp;Fl&aacute;vio Henrique Rodrigues &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp;Jos&eacute; Eduardo Zaine</p>\r\n<p>&nbsp;</p>', '', '', '', 152, 'pt'),
