	('Memória de Reuniões', '<p><strong>Reuni&atilde;o </strong><strong>do dia 20 de fevereiro de 2014</strong></p>\r\n<p><a href="http://abge.org.br/uploads/arquivos/archivoseccion_149_ata-cd_abge_20022014.pdf ">Clique aqui </a>e veja a ata!</p>\r\n<p><strong>Reuni&atilde;o </strong><strong>do dia 15 de abril de 2014</strong></p>\r\n<p><a href="http://abge.org.br/uploads/arquivos/archivoseccion_159_atacdabge_15042014.pdf ">Clique aqui </a>e veja a ata!</p>\r\n<p><strong>Reuni&atilde;o do dia 29 de maio de 2014</strong></p>\r\n<p><a href="http://abge.org.br/uploads/arquivos/archivoseccion_171_atacdabge_29052014_f.pdf ">Clique aqui</a> e veja a ata!</p>\r\n<p><strong>Reuni&atilde;o do dia 10 de julho de 2014</strong></p>\r\n<p><a href="http://abge.org.br/uploads/arquivos/archivoseccion_179_atacdabge_10072014.pdf ">Clique aqui</a> e veja a data!</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Calend&aacute;rio de Reuni&atilde;o do Conselho Deliberativo da ABGE</strong></p>\r\n<ul>\r\n    <li>15 de abril de 2014</li>\r\n    <li>29 de maio de 2014</li>\r\n    <li>10 de julho de 2014</li>\r\n    <li>28 de agosto de 2014</li>\r\n</ul>', '', '', '', 150, 'pt'),
	('Eventos em Tempo Real', '<h1 style="text-align: center;">Evento sobre TBM - 23/10</h1>\r\n<p>&nbsp;Instru&ccedil;&otilde;es: Para ver o evento em tempo real o usu&aacute;rio dever&aacute; fazer um pequeno cadastro no site do Livestream. Caso n&atilde;o consiga fazer o cadastro, entre com os dados abaixo:</p>\r\n<p>Login: abge@abge.org.br</p>\r\n<p>Senha: abge2014</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><iframe src="http://new.livestream.com/accounts/9792752/events/3488416/player?width=560&amp;height=315&amp;autoPlay=true&amp;mute=false" width="560" height="315" frameborder="0" scrolling="no"> </iframe></p>', '', '', '', 151, 'pt');
